                "gene": "HLA-DQA1 ",
                "related": "HLA-DQA1 基因位于6号染色体上，属于HLA II类α链旁系同源物。II类分子是由α（DQA）和β链（DQB）组成的异二聚体，两者都锚定在膜中。它通过呈递源自细胞外蛋白质的肽在免疫系统中发挥中心作用。II类分子在抗原呈递细胞（APC：B淋巴细胞，树突状细胞，巨噬细胞）中表达。是乳糜泻相关的主要遗传因子。能够在基因上区分易受乳糜泻影响的个体，特别是在患者的一级亲属（父母，兄弟姐妹和后代）中。"
