        "caseRate": "",
        "symptom": "1、初始症状\n多数起病缓慢、渐进，一般缺乏特殊的临床表现。约1/5患者无症状，仅在测量血压时，或者并发心、脑、肾等疾病时才被发现。\n2、一般症状\n一般常见有头晕、头痛、颈项板紧、疲劳、心悸等，呈轻度持续性，多数症状可自行缓解，在紧张或劳累后加重，也可出现视力模糊、鼻出血等较重症状。症状与血压水平有一定关联。",
        "prevention": "及时正确处理高血压十分重要，可在短时间内使病情缓解，预防进行性或不可逆性靶器官损害，降低死亡率。",
        "preventionGeneral": "1、合理膳食\n忌烟酒，忌浓烈红茶，低盐、低油、低糖饮食，减少钠盐、高脂食物摄入，多吃蔬果、杂粮，戒烟限酒。补充钙和钾盐。                      \n2、减轻体重\n尽量将体重指数(BMI)控制在25以内。体重降低对改善胰岛素抵抗、糖尿病、高脂血症和左心室肥厚均有益。\n3、适当运动\n运动有利于减轻体重和改善胰岛素抵抗，提高心血管适应调节能力，稳定血压水平。推荐中、低强度的等张运动，可根据年龄及身体情况选择慢跑或步行，一般每周运动3-5次，每次20-60分钟。\n4、控制情绪\n避免精神刺激、紧张，尤其不宜过度生气或兴奋。                       \n5、防寒保暖\n严寒天气出门时注意保暖，保证充足良好的睡眠。                             \n6、避免过度用力\n若患有高血压，大便不宜久蹲，避免太过用力，适当食用通便的食物或药物。",
        "preventionCheckup": "高血压高危人群，应按时定期的进行相关检查，以早日明确诊断并积极治疗。\n1、血压监测\n每周行2-3次血压监测、动态血压监测\n2、实验室检查\n血常规、尿常规、尿沉渣镜检、电解质、血生化、肾功能\n3、影像学检查\n心电图、超声心动图、胸部X线、眼底及颈动脉超声、24小时动态血压监测",
        "geneticCorrelation": "高血压是遗传易感性和环境因素相互作用的结果，一般认为遗传因素约占40%。除此之外，高血压具有明显的家族聚集性，约60%高血压患者可询问到有高血压家族史。",
