        "prevention": "冠心病是严重危害人类健康的常见病，也是全球第一大死因，而随着诊断及治疗技术进步，发病率及死亡率逐渐呈现下降趋势，对于高危人群，应定期的进行相关检查，以便早期发现、早期诊断、给予早期治疗。",
        "preventionGeneral": "1、生活习惯改变\n戒烟限酒，适当体育锻炼，控制体重，保证充足的休息和睡眠。\n2、饮食习惯改变\n低脂低盐低钠饮食，减少腌制食物及高热量食物的摄入，多食新鲜的蔬菜水果。\n3、其他\n注意季节变化，避免情绪过于激动，减轻工作压力。",
        "preventionCheckup": "对于高危人群，应定期进行相关检查，尤其是在冠心病（尤其是心绞痛）发作间期进行，可直接或间接反映心肌缺血。\n1、实验室检查\n血压、血脂、血糖、血生化、C反应蛋白、心肌坏死标记物（肌钙蛋白、肌红蛋白、肌酸激酶同工酶）。\n2、影像学检查\n心电图、24小时动态心电图、心电图负荷试验、心脏X线、超声心动图、心脏超声及CT、MRI。\n3、其他\n冠状动脉造影、放射性核素心肌显像。",
