        "symptom": "1、疼痛\n是最先出现的症状，多发生于清晨，为突然发作剧烈而持久的胸骨后或心前区压榨性疼痛。\n2、胃肠道症状\n疼痛剧烈时常伴有频繁的恶心、呕吐、上腹胀痛等，与迷走神经受坏死心肌刺激和心排血量降低、组织灌注不足等有关。\n3、全身症状\n有发热、心动过速、白细胞增高、血沉加快等，由坏死物质被吸收所致。一般在疼痛发生后24-48小时出现，程度与梗死范围常呈正相关。\n4、心律失常\n见于75%-95%的患者，多发生于起病1-2天，而以24小时内最多见，可伴乏力、头晕、晕厥等症状。\n5、心力衰竭\n主要是急性左心衰竭，可在起病最初几天内发生，发生率约为32%-48%。\n6、低血压与休克\n疼痛期中血压下降常见，未必是休克，若出现烦躁不安、面色苍白、大汗淋漓、尿量减少，甚至昏厥等，则为休克表现。",
        "prevention": "治疗原则为挽救濒死的心肌，缩小梗死面积，保护心脏功能，及时处理各种并发症。",
        "preventionGeneral": "1、一般的预防措施\n合理膳食、适当的体力劳动和体育锻炼、戒烟戒酒，积极治疗与心肌梗死相关的一些疾病（如冠心病、动脉硬化、三高病等）。\n2、季节因素\n在高发季节避免出现情绪波动及保暖，避免因冷空气刺激引起血管痉挛，尽量选择在白天阳光充足时进行室外活动，外出时携带硝酸甘油急救药物。\n3、防止便秘\n平时多食粗粮、新鲜的蔬菜及水果，保持大便通畅，避免用力排便。",
        "preventionCheckup": "急性心肌梗死发病突然，应定期的体检及复查，及早发现、及早治疗。\n1、心电图、超声心电图\n2、心肌坏死标志物\n肌红蛋白、肌钙蛋白、肌酸激酶、肌酸激酶同工酶、天冬氨酸氨基转移酶、乳酸脱氢酶等。\n3、其他实验室检查\n血常规、血沉检查、C反应蛋白等。\n4、放射性核素心肌显像检查",
