        "symptom": "1、初期症状\n通常发展迅速（数秒到数分钟），但亦可以是进程缓慢的一种症状。部分病人在初期会有轻微症状，如记忆减退、感受能力（听觉、视觉等）衰退、神智不清、行为异常等。\n2、后期症状\n若未能尽快得到适当治疗，可引发严重后果，对病人造成不可逆转的伤害，症状和受损部位有关，因此症状呈多样性。缺血性脑血管意外，通常只影响受阻动脉附近的脑组织，出血性脑血管意外影响局部脑组织，但由于出血及颅内压增高，往往也影响整个大脑。",
        "prevention": "鉴于脑血管意外的严重性，预防是一个重要的公共健康问题，脑血管意外的早期识别非常重要，只有详细的检查及医学影像学资料才能确诊类型和程度，因此即使是一般的征兆，也应及时到医院就诊。",
        "preventionGeneral": "1、生活方式调整\n养成良好的饮食习惯，遵循“低盐、低糖、低脂”饮食，避免过咸饮食，加强锻炼，适当控制体重，戒烟戒酒。根据自身的活动能力指导选择适合的运动，增强体质，降低血脂血压。规律作息、避免劳累。\n2、生活注意事项\n保持大便通畅，进食不要过饱。洗澡切忌过热、过冷、过久。注意保暖和防暑降温，避免长期进入高原地带。\n3、加强自我防护意识\n提高患者自我意识，让患者懂得脑血管意外的防治是一个长期的工作，停药或随意的减药都有严重的后果，规律服药，合理生活方式是预防脑血管意外的重要措施。",
        "preventionCheckup": "本病发病率较高，大多数人出现症状后才来就诊，导致预后较差，所以应定期的进行检查，以便早发现、早诊断、早治疗。\n1、神经学检查\n2、电脑断层扫描、核磁共振、多普勒超声和造影\n3、心电图、超声心电图、动态心电图\n4、血脂、血压、血糖、血生化",
        "geneticCorrelation": "本病与遗传有一定的相关性，存在有家族多发现象。",
