        "caseRate": "",
        "symptom": "1、前驱期\n许多病人在发生心脏骤停前有数天或数周，甚至数月的前驱症状，诸如心绞痛、气急或心悸的加重，易于疲劳，及其他非特异性的主诉。\n2、发病期\n即导致心脏骤停前的急性心血管改变时期，通常不超过1小时。典型表现包括：长时间的心绞痛或急性心肌梗塞的胸痛，急性呼吸困难，突然心悸，持续心动过速，或头晕目眩等。\n3、心脏骤停期\n意识完全丧失为该期的特征，如不及时抢救，一般在数分钟内进入死亡期，罕有自发逆转者。\n4、生物学死亡期\n从心脏骤停向生物学死亡的演进，主要取决于心脏骤停心电活动的类型和心脏复苏的及时性。心室颤动或心室停搏，如在前4～6分钟内未予心肺复苏，则预后很差。如在前8分钟内未予心肺复苏，除非在低温等特殊情况下，否则几乎无存活。",
        "prevention": "由于猝死可随时随地发生，因此要普及心脏复苏抢救知识。同时，还要做好防御措施。",
        "preventionGeneral": "1、精神调摄\n避免生活及工作压力过大，导致过度疲劳和精神紧张，定期的选择适合自己的方式进行减压。\n2、养成良好生活、饮食习惯\n戒烟、限酒、平衡膳食、控制体重、适当运动，保持良好的生活习惯。\n3、积极治疗基础疾病\n对已患有冠心病、高血压等疾病的患者应在医生指导下坚持服药治疗。",
        "preventionCheckup": "本病发病急，已有心脏病变的患者应及时定期复查，减少心脏意外发生。\n1、实验室检查\n血pH值、血糖、糖化血红蛋白、淀粉酶、血脂、血肌酐、尿素氮、血清同型半胱氨酸等。\n2、心电图、脑电图、心脏超声\n3、放射性核素心肌显像检查、冠状动脉造影",
        "geneticCorrelation": "在心脏性猝死的原因中一些遗传类型被认为与某些异常综合征有关。如有些先天性QT间期延长，肥厚性梗阻性心肌病及某些家族性心脏性猝死。",
