        "introduction": "强迫症(OCD)是一种以强迫思维(频繁而不自主闯入意识领域且使之烦恼或焦虑的想法和表像)和强迫行为( 刻板重复的行为，患者实施这种行为的目的是为了缓解由强迫思维引起的焦虑) 为主要临床症状的精神障碍。强迫症的表现可以自轻微到严重，但是假使症状严重而不治疗，可能摧毁一个人的工作能力，或在学校的表现，甚至连在家中的日常生活都有问题，最常见到的是重复而过度的清洁与检查行为。据估计，约有近2.3%的人，在一生中的某个时刻会被强迫症所困扰，半数以上的患者，大都在20岁以前就出现症状，只有相当少的案例是在35岁以后发病。",
        "advise": "1.强迫症重在预防，要从儿童抓起。要建立正常的亲子关系 , 坚持科学的教育方法 , 对一件事情不能无限地扩大或忽视。此外,做好模范作用，父母应该注意自己的行为模式,父(母)有神经质, 做事过于刻板, 孩子也会受其影响。所以, 家长对外界事物最好不要大惊小怪,而要做事果断,兴趣广泛。\n2.出现强迫症的早期表现, 则要及时送到医院请心理科大夫诊治, 可用心理治疗、生物反馈和松驰训练、药物治疗等。只要坚持治疗, 就能防止反复。",
        "cause": "1、生物学因素 \n由于同卵双胞胎比起非同卵双胞胎更容易罹患强迫症，因此部分原因可能是遗传因子所导致，多认为强迫症与大脑中5-羟色胺系统增高有关。\n2、心理社会因素 \n精神分析理论的观点认为，强迫行为根源于儿童时期被压抑的欲望及经历过负性的精神创伤，这些被压抑的“欲望”攻击性和创伤后的恐惧体验被压抑到潜意识中，本我和自我之间的强烈冲突形成了一系列防御机制，最终产生了强迫症状。",
