        "symptom": "1、强迫观念\n强迫观念是指尽管强迫症患者努力去忽视或者面对，但还是以刻板形式反复出现、不断侵入患者思想的想法和观念。强迫症患者频繁地重复做某件事情（强迫行为）则是为了缓解由于强迫观念而产生的焦虑情绪。\n2、强迫行为\n强迫症患者做出强迫性的仪式性行为是因为他们莫名地觉得他们不得不这么做，也有一些患者这么做则是为了缓解因为特定的强迫观念而带来的焦虑感。常见的强迫行为包括对特定的物体计数（比如楼梯）、反复的洗手、保证特定物品以直线摆放、反复检查是否在停车后锁车、开灯后关灯等。\n3、其他\n某些强迫症患者会表现出“超价观念”和“认知功能”。",
