        "introduction": "唇裂(俗称兔裂)与腭裂(俗称狼咽)是较常见的先天性畸形，单侧唇裂是指上唇出现一个裂隙，在母体妊娠前几周，如果胎儿鼻子和上颌的某些组成部分没有正确地融合在一起，即会出现唇裂，唇裂者多见，双侧唇裂者少见，上唇全部裂开直至鼻底是完全性唇裂，鼻底部未裂开是不完全性唇裂。腭裂因程度不同分为完全性腭裂与不完全性腭裂(根据悬雍垂、软腭及硬腭后部裂开程度不同而分类)。唇裂与腭裂的患儿除了上腭与颜面部畸形外，还出现不同程度的饮食、语言等功能障碍，喂养患儿也有不少困难。",
