        "advise": "剥脱性青光眼主要是预防\n1.养成良好的生活习惯   定时起居、戒烟酒、保持心情舒畅，避免情绪过度波动，适当锻炼，避免激烈运动\n2.注意用眼卫生，保护眼睛，不在强光下阅读，避免过度用眼。\n3.有青光眼家族史及危险因素者，定期复查，一旦有发病征象者，必须积极治疗。",
