        "relatedGenes": "LOXL1基因位于人类第15号染色体。该基因编码蛋白质赖氨酰氧化酶家族的成员。家族的原型成员对于结缔组织的生物发生是必需的，编码细胞外铜依赖性胺氧化酶，其催化在胶原和弹性蛋白中形成交联的第一步。经编码的前蛋白进行蛋白水解处理以产生成熟酶。C末端的高度保守的氨基酸序列似乎对于胺氧化酶活性是足够的，这表明每个家族成员都可以保留这个功能。N-末端保守性差，可能在家族成员发育调节，衰老，肿瘤抑制，细胞生长控制和趋化性中起额外的作用。该基因突变与剥脱综合征有关。",
