        "caseRate": null,
        "symptom": "不宁腿综合征的感觉包括包括疼痛或肌肉疼痛，“瘙痒却不能刮擦”、一种“嗡嗡的感觉”、一种令人不快的“挠痒痒”、“爬行”的感觉，或者在醒着的时候肢体抽搐，这种感觉通常在安静的清醒状态下开始或加强，比如放松、阅读、学习或者尝试着睡觉。因为睡眠品质受到影响，患有RLS的人可能会出现白天打瞌睡、白天的时候缺乏活力、敏感焦躁、易怒和抑郁等。",
        "prevention": "因本病病因不明，尚无明确的预防建议，如有发现异常，应及时就医，明确诊断，及时给予治疗。",
        "preventionGeneral": "1、饮食调整\n缺铁可能引起睡眠脚动症，饮食中因此应保持铁的摄入，如牡蛎、瘦红肉含有丰富的血红素铁，鸡蛋、乳制品、菠菜、豆类含有非血红素铁。\n2、培养良好的生活习惯 \n保持良好的心态，注意保暖，防寒防潮，少饮用咖啡及含咖啡因的饮料、浓茶，戒烟戒酒，睡前坚持洗澡或温水泡脚，适当的增加体育锻炼，增强体质。\n3、重视相关疾病的治疗\n在专科医生的指导下积极进行相关原发性疾病治疗，去除病因。",
