        "introduction": "进行性核上麻痹（PSP）是一种少见的神经系统变性疾病，主要临床表现有垂直性凝视麻痹、轴性肌张力障碍、跌倒、球麻痹、痴呆等，通常开始于中年晚期，同时伴发有帕金森病的症状，随着病情的发展，患者可出现严重强直并失去活动能力。平均发病年龄为60岁左右，男性多于女性，隐匿起病，逐渐加重。",
