        "symptom": "1、主要症状\n主要以反复口腔溃疡、皮肤病变（结节红斑、皮下栓塞性静脉炎、毛囊炎样皮疹、痤疮样皮疹）、眼部病变（虹膜睫状体炎、视网膜炎）、外阴溃疡为主要症状。\n2、累及症状\n其次还有一些累及关节、心血管、肺、肾、消化道症状，如无畸形关节炎、附睾炎、回盲部溃疡为主的消化系统病变、血管病变、中度以上的中枢神经病变等。",
