        "preventionGeneral": "1、生活指导\n进食清淡易消化，生活中我们要积极、主动的关心患者，加强与患者之间的沟通与交流。指导患者在患病期间要多注意休息，杜绝不良的生活、卫生习惯。\n2、口腔护理　\n口腔溃疡是ＢD最常见的首发症状，由于患者口腔粘膜损伤，张口、进食困难，同时口腔粘膜溃疡易继发细菌感染，激素及免疫抑制剂的长期应用亦易诱发感染，因此口腔护理十分重要。患病期间应注意口腔的清洁卫生，每天用0.2％呋喃西林口腔护理２次，养成饭后漱口的良好的卫生习惯。",
        "preventionCheckup": "本病主要涉及口、眼、生殖器，外形类似溃疡，自愈时间较长，需尽早诊断，给予治疗。\n1、实验室检查\n血沉、C反应蛋白、血常规、血生化、肝肾功能。\n2、免疫检查\n自身抗体如抗核抗体、抗内皮细胞抗体、结核或病毒等感染指标。\n3、辅助检查\n包括眼科的特殊检查、血管彩超、脑部磁共振、关节B超等。",
