        "symptom": "1、胃肠道症状\n最常见的是胃肠道症状，主要表现有食欲不振、恶心、呕吐、口腔有尿味。\n2、胃与十二指肠炎症、溃疡、出血\n胃与十二指肠炎症、溃疡、出血较常见，血液系统异常主要表现为肾性贫血和出血倾向，体液过多或酸中毒时均可出现气短气促、肺水肿或胸腔积液等症状，部分重症患者可伴有尿毒症、尿毒症胸膜炎、尿毒症肺钙化等。\n3、心血管病变\n心力衰竭是尿毒症患者最常见死亡原因，血液透析患者的动脉粥样硬化和血管钙化程度比透析前患者更重，动脉粥样硬化往往发展更为迅速，尿毒症性心肌病主要与代谢物的潴留和贫血等因素有关，心包积液在CKD病人中也相当常见。\n4、神经肌肉系统症状\n早期可有失眠、注意力不集中、记忆力减退等，随着病情的进展常有反应冷漠、惊厥、幻觉、嗜睡、昏迷、精神异常等，周围神经病变也很常见。\n5、内分泌功能紊乱\n可引起下丘脑-垂体内分泌功能紊乱，大多数病人均有继发性甲旁亢、胰岛素受体障碍、胰高血糖素升高等，约1/4患者有轻度甲状腺素水平降低。\n6、其他\n有些病人可伴有皮肤症状，如色素沉着、钙沉着、瘙痒、出汗困难、溃疡等。部分病人可有性腺功能减退，表现为性腺成熟障碍或萎缩、性欲低下、闭经、不育等。",
        "prevention": "为了明确CKD不同阶段的防治目标，提出三级预防概念很有必要。所谓一级预防，又称初级预防，是指对已有的肾脏疾患或可能引起肾损害的疾患（如糖尿病、高血压病等）进行及时有效的治疗，防治慢性肾衰竭的发生。二级预防，是指对已有轻、中度CRF的病人及时进行治疗，延缓、停止或逆转慢性肾衰竭的进展，防治尿毒症的发生。第三级预防，是指针对尿毒症病人及早采取治疗措施，防止尿毒症的某些严重并发症的发生，提高病人生存率和生活质量。",
        "preventionGeneral": "1、生活习惯改变\n遵循“低盐、低脂、低蛋白”饮食原则，戒烟戒酒，规律作息，保证充足的睡眠时间。\n2、积极治疗原发病\n对已有的肾脏疾患或可能引起肾损害的疾患（如糖尿病、高血压等）进行及时有效的治疗，防止CRF的发生，定期监测血压、血糖、血脂，避免或消除CRF急剧恶化的危险因素。",
        "preventionCheckup": "应定期进行相关检查，尤其是已有相关肾脏疾病者，如有异常，及时就诊。\n1、血尿常规、尿蛋白沉降率、电解质\n2、肾功能\n血肌酐、血尿素氮、血尿酸、β2微球蛋白、尿素氮肌酐比值、内生肌酐清除率。\n3、双肾B超、X线、MRI",
        "geneticCorrelation": "本病与遗传有一定的相关性。",
