        "symptom": "1、学龄前期症状\n学龄前期的一些现象就可以表明阅读障碍的存在，如语言发育迟缓，构音障碍，字母记忆、数数、认颜色困难，尤其是有阅读和学习障碍的家族史。\n2、早期症状\n有语音加工问题的儿童经常会有出现音的合成，词的节律，对词的发音位置的确认，将词分割为可发音的成分，按音的顺序重新组成词等困难。在选择词（词的发现障碍）、替代词、命名字母和图片时有延缓和迟疑的现象常是阅读障碍的早期症状。普遍存在短期的听觉记忆和排序的问题。\n3、常见症状\n许多阅读障碍者混淆相似的字母和词、视觉选择、字体识别、词汇中辅音/元音的识别。在小学低年级儿童中常发生颠倒或视觉混淆，然而大多数阅读和书写颠倒的发生是由于记忆的保持和回忆问题，造成的阅读障碍者遗忘或混淆了相似结构字母和词的名称。",
        "prevention": "因本病主要是由于先天性神经发育异常所致，尚无明确的预防措施，如有发现异常，应及时进行专科就诊，早发现、早诊断、早治疗、",
        "preventionGeneral": "1、早期干预  \n给予心理辅导，如开展以体验性学习为主的教育心理辅导课，其模式不同于以讲授为主的传统教学模式，采用互动的活动方式去影响他们的心理健康。\n2、心理咨询\n开展心理咨询就是创造一个温暖、接纳的环境，进而达到增进他们对自己、对学业的正向行为态度。 \n3、教育方法\n家长改进对孩子的教育方法，加强对学习因难学生的心理咨询和健康教育，使孩子保持良好的学习情绪十分重要。\n4、感觉统合训练 　\n感觉统合的本质就是以游戏的形式让孩子参加，以丰富孩子的感觉刺激。神经系统发育不规则的小孩，无法很好的感受自己游玩中的感觉。训练时在感觉统合治疗师的指导下，同时给予儿童前庭、肌肉、关节、皮肤触压、视、听、嗅等多种刺激，并将这种刺激与运动相结合，在整合中促进脑区脑细胞成熟和神经通路专门化，还可开拓新的神经专门化通道，促进学习障碍儿童的视、听觉和注意力等的发展。",
