        "symptom": "1、感知觉障碍 \n最突出的感知觉障碍是幻觉，包括幻听、幻视、幻嗅、幻味及幻触等，而幻听最为常见。\n2、思维障碍 \n思维障碍是精神分裂症的核心症状，主要包括思维形式障碍和思维内容障碍。妄想是最常见、最重要的思维内容障碍，最常出现的妄想有被害妄想、关系妄想、影响妄想、嫉妒妄想、夸大妄想、非血统妄想等。\n3、情感障碍 \n情感淡漠及情感反应不协调是精神分裂症患者最常见的情感症状，此外，不协调性兴奋、易激惹、抑郁及焦虑等情感症状也较常见。\n4、意志和行为障碍 \n多数患者的意志减退甚至缺乏，表现为活动减少、离群独处，行为被动，缺乏应有的积极性和主动性，对工作和学习兴趣减退，不关心前途，对将来没有明确打算，某些患者可能有一些计划和打算，但很少执行。\n5、认知功能障碍 \n在精神分裂症患者中认知缺陷的发生率高，约85%患者出现认知功能障碍，如信息处理和选择性注意、工作记忆、短时记忆和学习、执行功能等认知缺陷。",
        "prevention": "",
        "preventionGeneral": "1、合理膳食\n控制高热量饮食，高热量食物易发胖且脑细胞的氧化，损坏记忆、学习功能。多食新鲜的水果、蔬菜。\n2、生活习惯改变\n养成良好的生活习惯，戒烟酒、忌辛辣及刺激性饮食，禁茶、咖啡等。\n3、培养兴趣\n培养自己的兴趣爱好、提高患者的抗压能力和应变能力，如瑜伽、音乐、跳舞、画画、健身等。\n4、杜绝近亲结婚\n杜绝近亲结婚和减少高危人群互婚，降低人群中有害基因的频率、减少传递机会，降低发病率。",
