        "advise": "1.积极治疗原发病。对于过去有栓塞病、瓣膜病、高血压、糖尿病、老年患者、左心房扩大、冠心病等原发病应积极治疗。\n2.避免寒冷、情绪激动、饱食、饮酒等诱因。\n3.对长期房颤患者，应口服华法林预防血栓形成。",
