        "symptom": "1、症状\n一般无明显症状，长期的甘油三酯升高造成“血稠”，容易在血管壁上沉积，渐渐形成小斑块，即动脉粥样硬化。随之血管壁上的这些块状沉积会逐渐扩大面积和厚度，使血管内径变小、血流变慢，甚至血流中断，血流中断易使阻塞物脱落造成血栓。\n2、并发症\n此外还可引起冠心病、心梗、脑卒中、视力下降、肾衰等。",
        "prevention": "高甘油三酯可引发各系统多种疾病，需及时发现尽早治疗。",
        "preventionGeneral": "1、控制体重\n超重或肥胖的患者体重降低5％～10％，甘油三酯可降低20％左右。\n2、合理饮食\n控制饮食总热量、限制碳水化合物与脂肪摄入、增加蔬菜和优质蛋白摄入。\n3、戒烟限酒\n吸烟和酗酒是导致甘油三酯升高的常见原因，增加心脑血管疾病风险。\n4、适量运动\n规律性的体力运动有助于减轻体重，还可直接降低甘油三酯。",
        "preventionCheckup": "高危人群应每年定期体检，尤其是肥胖者。\n1、血脂检查\n血清总胆固醇(TC)、甘油三酯(TG)、低密度脂蛋白-胆固醇(LDL-C)、高密度脂蛋白-胆固醇(HDL-C)等。\n2、甲状腺功能、肝肾功能、血尿常规、血糖",
