        "caseRate": "",
        "symptom": "1、一般表现\n易疲劳、怕冷、体重增加、记忆力减退、反应迟钝、嗜睡、精神抑郁、便秘、月经不调及肌肉痉挛等。体检时可见面色苍白，眼睑和颊部虚肿，表情淡漠，痴呆，全身皮肤干燥、增厚、粗糙多脱屑，毛发脱落，手脚掌呈萎黄色。\n2、肌肉与关节\n肌肉乏力，暂时性肌强直、痉挛、疼痛，嚼肌、胸锁乳突肌及手部肌肉有进行性肌萎缩，腱反射的迟缓期特征性延长。\n3、心血管系统\n主要表现为心肌粘液性水肿导致心肌收缩力损伤、心动过缓、心排血量下降。冠心病在本病中高发，10%患者伴发高血压。\n4、血液系统\n主要因为甲状腺激素缺乏引起血红蛋白合成障碍、肠道吸收铁及叶酸障碍、恶性贫血及自身免疫系统疾病等导致贫血的发生。\n5、消化系统\n厌食、腹胀、便秘，严重者可出现麻痹性肠梗阻或黏液水肿性巨结肠。\n6、内分泌系统\n女性常有月经过多或闭经，严重者可有垂体增生、蝶鞍增大，部分患者有血清催乳素水平增高，发生溢乳。\n7、黏液性水肿昏迷\n见于病情严重者，多在冬季寒冷时发病，表现为嗜睡、低体温、呼吸徐缓、心动过缓、血压下降等，甚至昏迷、休克、肾功能不全危及生命。",
        "prevention": "本病影响多个系统，对于高危人群应定期的进行相关检查，以早期发现、早期诊断及早期给予治疗。",
        "preventionGeneral": "1、饮食\n限制胆固醇、脂肪、甜食的食物摄入，避免进食影响甲状腺的的食物如卷心菜、木薯、核桃等食物。有贫血症的甲低患者应补充富含铁质的饮食，纠正贫血，此外还应补充维生素B12等。\n2、补碘\n除了从碘盐中摄取，还可从含碘的酱油及面包、海带、紫菜中摄取。\n3、生活方式调整\n增强体育锻炼，控制体重，晨练宜晚不宜早，甲减患者免疫力降低，末梢循环不良，外出时宜注意保暖，促进血液循环。\n4、 定期筛查\n建议在老年人或大于35岁的人群中每5年筛查1次，以便发现临床甲减患者，特别是孕期妇女、不孕症和排卵功能异常者更需筛查。此外还应积极预防地方性呆小症。",
        "preventionCheckup": "对于甲减的诊断，需进行以下检查即可确诊。\n1、血红蛋白\n2、生化检查\n血清甘油三酯、总胆固醇、LDL-C、HDL-C、同型半胱氨酸、乳酸脱氢酶、肌酸激酶等。\n3、甲状腺功能\n血清总甲状腺素(TT4)、总三碘甲腺原氨酸(TT3)、游离甲状腺素(FT4)、游离三碘甲状腺原氨酸(FT3)、促甲状腺激素(TSH)。\n4、131I摄取率\n5、甲状腺自身抗体\n6、甲状腺B超、X线检查\n7、TRH刺激试验",
        "geneticCorrelation": "周围性甲减多为家庭遗传性疾病。",
