        "symptom": "1、症状\n起病缓慢、病程较长。主要症状是慢性咳嗽、咳痰、气短或呼吸困难、喘息和胸闷，常晨间咳嗽明显，咳痰一般为白色黏液或浆液性泡沫性痰，气短或呼吸困难在劳力时出现，后逐渐加重，重度患者在急性加重时可出现喘息。此外晚期患者还有体重下降、食欲减退等。\n2、体征\n早期体征可无异常，随着病情的发展可出现桶状胸，双侧语颤减弱，两肺呼吸音减弱、呼气延长、部分患者可闻及湿/干啰音，叩诊是肺过清音、心浊音界缩小及肺下界和肝浊音界下降。",
        "prevention": "COPD的预防主要是避免发病的高危因素、急性加重的诱发因素以及增强机体免疫力。",
        "preventionGeneral": "1、戒烟\n戒烟是预防COPD的重要措施，也是最简单易行的措施，在疾病的任何阶段都有益于防止COPD的发生和发展。\n2、环境改善\n控制职业和环境污染，减少有害气体或有害颗粒的吸入，可减轻气道和肺的异常炎症反应。\n3、积极预防相关疾病\n积极防治婴幼儿和儿童期的呼吸系统感染，以及流感疫苗、肺炎链球菌疫苗、细菌溶解物、卡介苗多糖核酸等都有助于减少COPD的发生。\n4、增强锻炼\n加强体育锻炼、增强体质，提高机体免疫力，可帮助改善机体一般状况。",
