        "symptom": "1、主要症状\n典型症状为手节律性外展内收样震颤和屈伸样震颤，影响颅颈肌肉群时表现为病人手部严重的姿位性震颤和头部震颤，包括垂直的“点头”运动和水平的“摇头”运动，影响软腭、舌的震颤会导致发声困难。\n2、不典型症状\n可出现不典型的震颤表现，有手部的运动障碍、复合的静止性和姿位性震颤、原发性书写震颤、局限的发声震颤、下颌震颤、局限的舌震颤和直立性震颤。",
        "prevention": "该病缓慢进展，由震颤造成劳动力丧失开始于发病10至20年之后，发生率随着病程和年龄的增长而增加。",
