        "name": "干燥综合征",
        "phenotypeTplId": 1,
        "introduction": "干燥综合征（SS）是一种以侵犯唾液腺和泪腺等外分泌腺体，具有高度淋巴细胞侵润为特征的弥漫性结缔组织病。其免疫炎症反应主要表现在外分泌腺体的上皮细胞，故又名自身免疫性外分泌腺体上皮细胞炎或自身免疫性外分泌病。临床表现为干燥性角、结膜炎，口腔干燥症，还可累及其他重要内脏器官如肝、肺、胰腺、肾脏及血液系统、神经系统等，出现复杂的临床表现。本病可发生于任何年龄，女性多于男性，好发年龄在30~60岁，占全部病例的90%。",
        "advise": "1.调节饮食: 患者平时饮食应偏于甘凉滋润, 宜多吃滋阴清热生津的食物。如丝瓜、西瓜、鲜梨、鲜藕、芹菜、黄花菜、淡菜、甲鱼等, 经常用太子参、西洋参泡饮。口舌干燥者可常含用话梅、藏青果等, 或常饮酸梅汁、澄汁、柠檬汁等生津解渴饮料。应避免进食辛辣火热的饮料和食物, 以防助燥伤津, 加重病情。忌用酒、咖啡、茶、各类油炸食物、羊肉、狗肉、鹿肉以及姜、葱、蒜、 辣椒、胡椒等。严格禁止吸烟。\n2.加强精神调摄, 劳逸适度, 保持居住环境的湿度。注意精神调摄, 保持乐观的精神状态, 避免精神刺激和急躁大怒, 要劳逸适度, 保持充足睡眠, 避免过劳。平时应慎起居, 适寒温, 以防六淫外邪的侵袭。 \n3.保持口腔清洁, 饭后立即漱口或刷牙, 保持口腔内清洁卫生, 可预防和减少龋齿和口腔继发感染。",
        "cause": "干燥综合征确切病因不明，多考虑主要是基因遗传、环境因素、病毒感染以及内分泌因素等相互作用的结果，某些病毒如EB病毒、丙型肝炎病毒及HIV可能与本病的发生和延续有关。",
        "relatedGenes": "1.STAT4基因位于人类第2号染色体。由该基因编码的蛋白质是STAT家族的转录因子的成员，STAT家族成员被受体相关激酶磷酸化，然后形成易位于细胞核的同源或异二聚体，在那里它们作为转录激活因子。这种蛋白质是介导对淋巴细胞中IL12的反应和调节T辅助细胞分化所必需的。该基因的突变与系统性红斑狼疮和类风湿性关节炎等免疫系统疾病相关。\n2.TNPO3基因位于人类第7号染色体。由该基因编码的蛋白质是丝氨酸/富含精氨酸（SR）蛋白质的核进口受体，例如剪接因子SFRS1和SFRS2。 TH1048869254的风险等位基因，与IRF5表达相关，差异性结合转录因子ZBTB3。相关研究表明，IRF5-TNPO3基因与原发性胆汁性肝硬化、干燥综合征相关。",
