        "symptom": "1、局部表现\n局部的表现主要为因唾液腺病变引起口干燥症、因泪腺分泌异常导致干燥性角结膜炎及其他部位如鼻、硬腭、气管、消化道黏膜等受累，使其分泌减少而出现相应的症状。\n2、系统表现\n常见的全身症状如乏力、低热、各种皮疹、关节痛、肾脏损伤、肺功能异常等，还可累及消化系统、神经系统、血液系统，出现各系统的相应症状。",
        "prevention": "目前本病主要是替代和对症治疗，治疗目的是预防因长期的口、眼干燥造成局部损伤，密切随诊观察病情变化，防治本病系统损害。",
        "preventionGeneral": "1、调节饮食\n患者平时饮食应偏于甘凉滋润，宜多吃滋阴清热生津的食物。如丝瓜、西瓜、鲜梨、鲜藕、芹菜、黄花菜、淡菜、甲鱼等，经常用太子参、西洋参泡饮。口舌干燥者可常含话梅、藏青果等，或常饮酸梅汁、澄汁、柠檬汁等生津解渴饮料。应避免进食辛辣火热的饮料和食物，以防助燥伤津，加重病情。忌用咖啡、茶、各类油炸食物、羊肉、狗肉以及姜、葱、蒜、 辣椒、胡椒等。\n2、生活方式改善\n戒烟戒酒，加强精神调摄，劳逸适度，保持乐观的精神状态，避免精神刺激和急躁大怒，保持充足睡眠，避免过劳，平时应慎起居，适寒温，以防六淫外邪的侵袭。 \n3、个人口腔卫生\n保持口腔清洁，饭后立即漱口或刷牙，预防和减少龋齿和口腔继发感染。",
        "preventionCheckup": "对于已有症状者，应及时进行检查确诊，以便早期予以治疗，避免因治疗不及时导致病情恶化甚至危及生命。\n1、抗细胞核抗体、类风湿因子\n2、泪腺、唾液腺功能测试\n3、唾液腺超声波检查",
        "geneticCorrelation": "流行病学调查证明有家族病史的人群发病率高于正常人群。",
