        "introduction": "背痛包括有肌肉、神经、骨骼、关节或与脊柱相关的疼痛，主要以腰背、腰骶和骶髂部的疼痛为主。背痛可以分为颈部疼痛、肩部疼痛、腰部疼痛和尾椎疼痛，又可分为急性或慢性、持续或间歇性、同一部位或多个部位的疼痛。任何年龄段皆可发病，中老年人发生背痛的概率更高。",
        "advise": "1.养成良好的生活习惯 \n忌食高热量食物，多食水果蔬菜，保持体重。坚持锻炼，每天锻炼四十五分钟，如跑步、游泳、瑜伽等。\n2.缓解压力  \n学会释放压力，听听音乐，不要工作时保持一个姿势，可以中间走走路，喝喝茶，换个状态。\n3.避免腰部外伤\n弯腰拾东西时，不可用力过猛；腰部不可负担太重，背过重东西。",
