        "preventionGeneral": "1、增强锻炼\n每周根据自身情况进行跑跳或快走的锻炼，可选择会调用到腰腹部及背部肌肉的运动方式，如游泳、平板支撑、卷腹等。\n2、调整坐姿\n保持良好的站姿和坐姿，避免弯腰驼背；长期坐着办公或驾驶时，可以给腰背部放一个靠枕支撑，且尽量隔一个小时活动一下身体。\n3、改善生活方式\n保持良好的生活习惯，合理膳食，避免长期的熬夜，戒烟戒酒，调整心态。\n4、避免腰部受伤\n避免腰部外伤，弯腰时不可用力过猛，腰背部不可负担太重。",
