        "caseRate": null,
        "symptom": "1、口 - 舌 - 颊三联征\n临床上以不自主的、有节律的刻板运动为特征，多数表现为“口 - 舌 - 颊三联征”，即口、唇、舌、面部不自主运动，如舌头不自主在口中转，不自主咀嚼等。\n2、肌张力障碍\n另一种常见表现是肌张力障碍，并可出现异常姿势，常累及颈部（痉挛性斜颈），可扩展为节段性或全身性。此外舞蹈症与肌张力障碍并存也很普遍。",
        "prevention": "本病重在预防，尤其是长期服用抗精神病药物的人群中，应定期复诊，在专科医生的指导下安全用药，严格遵循医嘱，切不可盲目用药及擅自停药。",
        "preventionGeneral": "1、合理用药  \n由于TD发病与抗精神病药物使用时间长短有关，对于需要长期服用抗精神病药物的患者，经医师综合评估可行的情况下，可考虑选择服用迟发性运动障碍风险较低的药物。\n2、维生素E的应用  \n维生素E作为抗氧化剂能安全高效的清除自由基，据此学者们用维生素E治疗TD，结果显示大剂量维生素E( 1200～1600IU/日)治疗8～12周，疗效明显大于安慰剂，特别对TD病程较短者疗效更佳。\n3、改善生活方式\n加强锻炼，可以进行一些有氧运动，慢跑、太极等。膳食均衡，多食新鲜的水果蔬菜等，避免长期摄入辛辣刺激性食物，戒烟戒酒。",
        "preventionCheckup": "本病主要与服用药物有关，无特殊的体检预防方案，对于服用药物者，应定期复诊，在专科医生的指导下合理安全用药。",
