        "symptom": "1、早期症状\n本病起病隐匿、缓慢，无症状者约占首次诊断的20%~60%，早期症状较轻，乏力和皮肤瘙痒为本病最常见的首发症状。\n2、胆汁淤积症状\n因长期的肝内胆汁淤积导致分泌和排泄至肠腔的胆汁减少，影响脂肪的消化吸收，出现皮肤粗糙、夜盲症、骨软化、骨质疏松和出血倾向等。由于胆小管阻塞，血中脂类总量和胆固醇持续增高，可形成黄瘤。\n3、肝肿大\n肝呈中度或显著肿大，常在肋下4~10cm，质硬，表面平滑，压痛不明显，脾也中度肿大，晚期可出现腹水、门静脉高压和肝功能衰竭，病变长期发展可并发肝癌。\n4、其他\n还可伴有干燥综合征、甲状腺炎、类风湿性关节炎等自身免疫性疾病。",
        "prevention": "PBC预后差异很大，定期的检查对于疾病的发现、确诊具有重大意义，如有不适，应立即就诊。",
        "preventionGeneral": "1、心理调整　\nPBC病程长、病情重、并发症反复发作，易出现情绪不稳定，心理压力大，要保持平和的心态。\n2、饮食调护　\n饮食以优质蛋白、低脂肪为主导原则，加强维生素Ｄ和钙的摄入，清淡饮食为主，减少辛辣刺激、坚硬食物的摄入。 \n3、皮肤护理  \n尽量穿全棉、宽松的衣裤，常以温水清洗，保持皮肤清洁，忌用碱性皂液。剪短指甲，皮肤瘙痒时可用轻叩或抚摸瘙痒部位的方式缓解，禁搔抓。\n4、适当活动　\n适当的体育活动可增强体质，遵循“劳逸结合、循序渐进”的原则，以散步慢跑为主，避免激烈运动。",
