        "symptom": "1、代偿期症状\n代偿期症状较轻，以乏力、纳差出现较早，肝轻度肿大，质地结实或偏硬，脾轻、中度肿大。肝功能检查结果正常或轻度异常。\n2、失代偿期症状\n失代偿期症状显著，主要有消瘦乏力，精神不振，食欲减退或厌食，上腹饱胀、恶心、呕吐或腹泻。常有鼻出血、牙龄出血和胃肠道出血，还可有不同程度的贫血。女性可表现月经失调、闭经不孕，男性常有性欲减退、毛发脱落及乳房发育等。\n3、晚期症状\n晚期基本症状表现为肝区疼痛、全身无力、消化不良、食欲不振、恶心呕吐、发热、腹胀腹泻等症状。较严重时表现为上消化道出血及精神症状，门脉高压及合并症，表现脾脏肿大、食管静脉曲张及腹水、蜘蛛痣、肝掌等症状。",
        "prevention": "本病无特效治疗，关键在于早期诊断，针对病因和加强一般治疗，使病情缓解及延长其代偿期，对失代偿期患者主要是对症治疗，改善肝功能和抢救并发症。",
        "preventionGeneral": "1、戒酒  \n饮酒是诱发酒精性肝硬化的主要原因，戒酒的疗效与肝病的严重度有关。早期酒精肝患者在完全戒酒2-4周后，多数可表现组织学和肝功能明显改善，甚至可恢复正常。戒酒对代偿性和失代偿性肝硬化的5年生存率均有明显影响。\n2、休息\n宜适当减少活动，注意劳逸结合，失代偿期应卧床休息为主。\n3、饮食\n饮食以高热量、高蛋白质、维生素丰富且易消化的食物为宜，避免进粗糙、坚硬食物及损害肝脏的药物，应适当补充维生素B族、维生素A、C、K及叶酸等。有肝性脑病先兆时，应限制或禁食蛋白质；有腹水时饮食应少盐或无盐。",
