        "introduction": "丛集性头痛是一种神经性疾病，常见症状为反复性的严重偏头痛，常见在眼眶周围，通常会伴随流泪、鼻塞、患侧眼眶红肿，症状持续15分钟到3小时左右，头痛会断断续续持续一周或一个月，有些甚至会到一年左右。20到40岁为丛集性头痛的好发族群，男性的患者数量比女性多四倍。",
        "advise": "1.避免精神刺激  在头痛发作间歇期，目前尚无有效的预防发作方法。但精神上的应激多可诱发头痛发作 ,因此应尽可能控制情绪,避免精神紧张。因1月及7月易发生头痛发作,故接近此时要避免改变睡眠觉醒的规律和睡眠不足。 \n2.调理防护  头痛丛集性发作的时期，除诱因导致发作外,还应避免饮酒、服血管扩张药、吸有机溶剂等。高山性的低氧血症也可诱发头痛，故于头痛期应避免爬高山及乘飞机。如果头痛开始, 可以1分钟7立升的速度吸入纯氧10～15分钟,此法安全且可获效。在药房及运动用品店可买到氧气,但因不是纯氧,故效果不理想 ,因此要采取鼻面罩充分吸入纯氧。\n3.药物治疗  头痛因常在夜间发生,故每晚均疼痛的病人 ,应在入睡1小时前服用酒石酸麦角胺制剂, 能抑制头痛的夜间发作。对于发作型的丛集性头痛,在欧美使用二甲麦角新碱,肾上腺皮质激素有一定的疗效。慢性型的丛集性头痛,碳酸锂有一定疗效但此药不好掌握, 使用起来较难。钙拮抗剂维拉帕米,有时可能有效。在欧美则应用5-羟色胺激动药的英明格皮下注射。",
        "cause": "1、吸烟饮酒\n有吸烟习惯的人群患病率比不吸烟的人群高，饮酒也可造成刺激，都是危险因素。\n2、血管障碍\n病因不明，传统的观点认为CH与血管功能障碍有关。此外三叉神经痛等疾病也可加重丛集性头痛。",
