        "symptom": "1、白天过度嗜睡\n主要表现为白天有不可抗拒的短暂睡眠发作，常在起床后3-4小时发生，发作时虽力求保持清醒，但不能自制，很快进入睡眠状态，一般持续数分钟，每日可发作多次，发作不择时间、地点及活动情况。\n2、猝倒\n表现为突然出现的不自主低头或突然倒地，但意识始终清楚，通常只持续几秒钟，一般每天只发作一次，通常因有情绪上的刺激，如大笑、愤怒、兴奋等所诱发。\n3、入睡前幻觉\n入睡前和醒后出现幻觉，见于12%-50%的发作性睡病患者，患者可在入睡前或觉醒时出现生动的，常常是不愉快的感觉性体验，包括视觉、触觉、运动或听觉等。\n4、睡眠瘫痪\n睡眠瘫痪是发作性睡病患者从睡梦中醒来时发生的一过性的全身不能活动或不能讲话，仅呼吸和眼球运动不受影响的恐怖体验，绝大部分患者他人呼唤和推摇可中止发作，个别患者不能唤醒。\n5、其他\n很多患者伴有失眠​、记忆力减退、心悸、全身无力、抑郁、焦虑等。",
        "prevention": "本病病程较长，影响生活和工作质量，应及时给予治疗。",
        "preventionGeneral": "1、丰富生活内容\n应有意识地把生活安排得丰富多彩，多参加文体活动，做些有兴趣的工作，尽量避免从事单调的活动，白天可适当饮点茶或咖啡以增加大脑兴奋性。\n2、调整心态\n保持乐观的心态，树立信心，避免压力过大及忧郁悲伤，但也不宜过于兴奋。合理安排作息时间，有规律的工作和休息，尽量保证夜间获得充足的睡眠，避免情绪激动和过度紧张，白天加强体力活动以改善白天嗜睡情况。\n3、自我防范\n拒绝主动吸烟及被动吸烟，避免暴露于烟草环境。最好不要独自远行及从事高空、水下作业，更不能从事驾驶车辆，管理各种信号及其他责任重大的工作，以免发生意外事故。",
