        "symptom": "1、酒精的躯体依赖性\n酒精精神依赖是指对酒的渴求，早期并没有出现明显的躯体症状，当发展严重时，患者恐惧戒断症状出现，表现强烈的饮酒渴求，导致不可控制即酒瘾。\n2、戒断综合征\n震颤是酒精依赖患者典型的戒断症状之一，通常在患者停止饮酒后7～8个小时出现，这种震颤会随着情绪的激动加重。还有一些患者会出现恶心、呕吐、食欲不振。\n3、酒精中毒性精神障碍\n急性酒精中毒患者在一次大量饮酒后出现情绪兴奋、话多、精神充沛、运动失调、震颤等，随着酒醒后上述症状就会消失。慢性酒精中毒患者长期饮酒后出现精神方面的异常，常见幻觉、幻听、震颤、妄想、人格衰退，严重者出现痴呆、抑郁症状等。",
        "prevention": "酒精依赖对人体的危害广泛而严重，应及时调整，严重者还应在专科医生的指导下进行相关治疗。",
        "preventionGeneral": "1、改变饮酒习惯\n饮酒时，一定要先吃一部分食物后再喝酒，做到少量及慢喝，酒后多饮水，因酒使机体内细胞脱水，睡前喝一部分水，醒后再补充水，使得酒精能够尽快随尿液排出。\n2、饮食调整\n饮食应均衡，常吃蜂蜜、果汁，尽量不吃油炸及脂肪食物。平时爱喝酒的人，一定要多服用复合维生素， 如维生素B1、B3。多吃一些含氨基酸食物，减少酒对机体的损伤。\n3、自我认识\n自己一定要清楚认识到大量饮酒对身体有严重危害，努力克制自己。",
