        "symptom": "1、重性抑郁障碍\n重性抑郁障碍的症状最为严重，主要表现在心境、认知和躯体功能三方面。心境方面，患者长期（两周以上）处于极其抑郁的情感状态中；认知方面，患者往往看到事物的消极面，被空虚感和无价值感包围；躯体功能方面主要有进食和睡眠障碍，无力感，头痛等。患者可能反复想到死或者有自杀企图，最终大约有3.4%的患者自杀。\n2、心境恶劣障碍\n心境恶劣障碍的程度稍轻一些，而持续时间长，一般要持续2年才能确诊，而总的病程可以持续10年以上甚至一生。\n3、季节性情绪失调\n主要特点是在寒冷季节发病并在其他季节完全缓解。季节性情绪失调随纬度的增高而越发流行, 即日照时间越少，发病率越高。多晒太阳可减轻病情，对这种疾病的诊断需要确认患者只在特定时节发病而在其他季节从未发病。",
        "prevention": "抑郁症在积极治疗的情况下预后良好，但考虑到患者须承受极大痛苦的可能，因此应尽早尽快进行积极治疗。",
        "preventionGeneral": "1、沐浴阳光多做运动\n据有关的研究证实，阳光是极好的天然抗抑郁苭物，而早晨的阳光效果最佳，会渐渐找回放松的心情，这对抑郁症的预防是很有效的。\n2、保持良好的生活习惯\n将自己的生活作息合理化，改掉翘课出去玩或睡懒觉的习惯。尽量避免酗酒、暴饮暴食，每天至少做一件有意义的事让自己充实起来等。\n3、合理宣泄抑郁情绪\n从个体心理的角度而言，人都有交流、宣泄、归属的需要，哪怕是身处荒岛，也会自言自语或向花草树木鸟兽倾诉，这是抑郁症的预防的重要方面。",
