        "symptom": "1、躁期\n患者会产生极度愉悦的情绪，这样的情绪可能被当事人形容为兴奋的、有活力的、满足的、狂喜的及冲动的等。除此之外，患者会表现出许多与亢奋情绪相关的行为，包括自我膨胀、精力旺盛、多话、性欲增加、失眠，并且会产生自制力降低和危机感增高的情形。\n2、郁期\n患者会感到忧郁，包括闷闷不乐、伤心、做任何事都提不起劲、悲痛、自我厌恶等。如果进入重郁，也有可能感到失去生存的动力，产生想自杀的念头，或者将自杀付诸行动。",
        "prevention": "本病病程较长，对生活和工作质量造成严重影响，应及时就诊，早期给予治疗，避免延误病情，造成更严重后果。",
        "preventionGeneral": "1、限制酒精摄入\n限制酒精摄入，中国营养学会建议，成年人适量饮酒的限量值是成年男性一天饮酒量不超过25g，成年女性一天饮酒量不超过15g。\n2、避免接触相关药物\n严禁接触大麻及相关精神类药物，如可卡因和安非他明等。\n3、调整环境及心态\n选择包容度高、生活压力低的社会环境进行工作和生活，与亲友和同事维持和睦融洽的关系，提升自己应对心理压力和生活负担的能力，以免诱发疾病。",
