        "symptom": "1、消化系统表现\n腹痛、腹泻、腹部包块、瘘管形成、肛门周围病变是常见的症状，多位于右下腹或脐周，间歇性发作，常为痉挛性阵痛伴腹鸣。腹泻先是间歇发作，病程后期可转为持续性。约10%~20%的患者可见腹部包块，瘘管形成是克罗恩病的特征性临床表现。\n2、全身表现\n发热是常见的全身表现之一，与肠道炎症活动及继发感染有关。此外还将出现由慢性腹泻、食欲减退及慢性消耗导致的营养障碍表现。\n3、肠外表现\n以口腔黏膜溃疡、皮肤结节性红斑、关节炎及眼病为常见。\n4、并发症\n以肠梗阻最常见，其次是腹腔内脓肿，偶可并发急性穿孔及大量便血。",
        "prevention": "治疗原则与溃疡性结肠炎类似，主要是控制急性发作，维持缓解，减少复发，防治并发症。相当部分克罗恩病患者在疾病过程中最终因并发症而需要手术治疗，但克罗恩病术后复发率高，至今尚无预防术后复发的有效措施。",
        "preventionGeneral": "1、饮食\n给予高营养低渣饮食，适当的增加一些富含叶酸、维生素B12等多种维生素的蔬菜及水果。\n2、戒烟\n因吸烟会增加患病风险，必须戒烟，同时应该限制酒精的摄入量。\n3、休息\n保证充足的休息时间，避免长期的熬夜，选择适合自己的方式进行减压。",
        "preventionCheckup": "对于高危患者应及时的进行相关检查，预防本病的发生，早发现、早诊断、早治疗。\n1、血沉、C反应蛋白、血常规、血生化、粪便隐血试验、贫血检查\n2、钡剂造影、X线、超声、CT、MRI\n3、结肠镜检查\n4、活组织检查",
