        "name": "乳糜泻",
        "phenotypeTplId": 1,
        "introduction": "乳糜泻又称乳糜腹泻，是一种长期的自身免疫性疾病，主要发生在遗传易感者的小肠，从婴儿到各年龄段的人都有。典型症状包括消化道问题，如慢性腹泻、腹胀、吸收不良、食欲不振以及儿童未能正常生长，通常从六个月到两岁开始发病。非典型症状是最常见的，特别是在两岁以上的人群中，可能没有或轻度胃肠道症状，涉及身体任何部位的多症状，或无明显症状。然而，它可能在任何年龄发病，本病常与其他自身免疫性疾病有关，如1型糖尿病和甲状腺炎等。",
        "advise": "1. 无麸质饮食：严格遵守饮食会使肠道愈合，大多数情况下所有症状会得到解决。通常要征求营养师的意见，以确保哪些食物含有麸质，哪些食物是安全的，以及如何均衡饮食。无麸质术语通常用于表示所预期的无麸质水平，而不是完全不存在麸质。麸质无害的确切水平是不确定和有争议的。最近的一项系统评价暂时得出结论，每天消耗少于10毫克的麸质不太可能导致组织学异常。标签无麸质的调节有所不同。欧盟委员会在2009年颁布了限制对食品使用“无麸质”标签的规定，对于含有少于20毫克/公斤麸质的食品定义为“低麸质”。在美国，FDA于2013年发布了有关食品中不含“无麸质”标签的规定，限制在少于20ppm麸质的食品。严格遵守饮食比不完全遵守更有利。然而，无麸质饮食并不能完全正常化生活质量。\n2.在婴儿生命早期吃麸质似乎并没有增加发病风险，但是6个月后可能会增加。母乳喂养是否有降低风险的不确定性，延长母乳喂养直到将含麸质颗粒引入饮食中似乎与婴儿期发展乳糜泻的风险降低了50％有关；这是否持续到成年还不清楚。这些因素可能只会影响发病的时间。",
        "cause": "1、麸质谷物\n乳糜泻是由小麦中发现的麦醇溶蛋白和谷蛋白（麸质蛋白）的反应引起的。小麦和如黑小麦也可诱发乳糜泻的症状。\n2、其他谷物\n其他谷物如玉米、小米、高粱、茶叶、大米和野生稻对于腹腔消耗的人是安全的。土豆和香蕉不含麸质，不引发症状。\n3、其他\n手术、怀孕、感染和情绪压力等，都可能引起该病的发生。",
        "relatedGenes": "HLA-DQA1 基因位于6号染色体上，属于HLA II类α链旁系同源物。II类分子是由α（DQA）和β链（DQB）组成的异二聚体，两者都锚定在膜中。它通过呈递源自细胞外蛋白质的肽在免疫系统中发挥中心作用。II类分子在抗原呈递细胞（APC：B淋巴细胞，树突状细胞，巨噬细胞）中表达。是乳糜泻相关的主要遗传因子。能够在基因上区分易受乳糜泻影响的个体，特别是在患者的一级亲属（父母，兄弟姐妹和后代）中。",
