        "symptom": "1、腹泻、腹痛\n80%-97%的病人有腹泻，典型者呈脂肪泻，粪便色淡、量多、油脂状或泡沫样，常飘浮于水面，多具恶臭，每日大便次数从数次至十余次，多数患者有经常性或间歇性腹泻，少数早期或轻型病例可无腹泻，甚至可有便秘，常可被漏诊。腹痛较腹泻少见，多为腹胀痛，常在排便前出现，腹部可有轻度压痛，有些病例有明显腹胀、恶心和呕吐。\n2、体重减轻、倦怠乏力\n程度不一，消瘦、乏力主要因蛋白质、脂肪等吸收障碍，另脱水、缺钾、食欲不振也是重要因素，严重病例可呈恶病质。\n3、维生素缺乏及电解质紊乱的表现\n钙和维生素D缺乏可致手足搐搦、感觉异常、骨质疏松、骨软化并可引起骨痛。维生素K缺乏可致出血倾向。维生素B族缺乏可致舌苔、口炎、口角炎、脚气病、糙皮病样色素沉着等。维生素A缺乏可致毛囊角化、角膜干燥、夜盲等。半数以上病人有贫血，并伴有凹甲。少数病人可有肌肉压痛及杵状指（趾）。\n4、水肿、发热和夜尿\n水肿常见，发热多因伴发感染所致。发病期夜尿量多于昼尿量，可有IgA肾病、不育症、出血倾向。",
        "prevention": "目前虽去除麸质的饮食可以改变患病儿童的预后，实际上也改善成年患者的预后，但有些一开始病情就十分严重的成年患者预后并不良好。",
        "preventionGeneral": "1、无麸质饮食\n严格遵守饮食会使肠道愈合，大多数情况下所有症状会得到解决。通常要征求营养师的意见，以确保哪些食物含有麸质，哪些食物是安全的，以及如何均衡饮食，改善患者的营养状况。选择低脂少渣的果汁或蔬菜汁，尽量采用氽、煮、炖、熬等烹调法。\n2、其他\n在婴儿生命早期吃麸质似乎并没有增加发病风险，但是6个月后可能会增加。延长母乳喂养直到将含麸质颗粒引入饮食中，可降低了50％的发病风险。",
        "preventionCheckup": "对于有家族史者，尤其是婴幼儿，应定期进行相关检查。\n1、血尿便常规、血生化、微量元素检测\n2、免疫学检查\n3、粪脂测定及脂肪平衡试验、D木糖试验\n4、胃肠钡餐检查、小肠粘膜组织检查",
        "geneticCorrelation": "本病与遗传因素有关。挛生兄弟的发病为16％，一卵双生者可达75％，因遗传关系肠粘膜缺少麦胶蛋白分解酶，另外遗传影响机体免疫功能，对麦胶产生过敏反应。",
