        "symptom": "1、常见症状\nAD患者临床表现多种多样，经常有干燥、鳞片状的皮肤，伴有瘙痒的红色，突发性的斑块，在胳膊或腿部、脸部和颈部弯曲处形成的病变。AD通常发生在眼皮上，可见“丹尼-摩根”眶下折叠，耳内裂隙，眶周色素沉着等症状。脖子上的炎症消退后色素沉着，呈现出经典的“脖颈”外观。\n2、严重症状\n出现类似树干上的结痂、排泄、侵蚀征或结皮可能表明继发感染。",
        "prevention": "湿疹病因复杂，治疗好转后仍易反复发作，难根治。因临床形态和部位各有特点，故用药因人而异。",
