        "symptom": "1、早期症状\n胆囊结石在早期通常没有明显症状，大多数是在常规体检中发现。有时可以伴有轻微不适被误认为是胃病而没有及时就诊。\n2、相关症状\n当部分单发或多发的胆结石在胆囊内自由存在时不易发生嵌顿，很少产生症状，被称为无症状胆囊结石；当胆石嵌于胆囊颈部时，造成急性梗阻，导致胆囊内压力增高，胆汁不能通过胆囊颈和胆囊管排出，从而引起临床症状，通常表现为胆绞痛，呈持续性右上腹痛，阵发性加剧，可以向右肩背放射，往往会伴有恶心、呕吐。有部分患者可以在几小时后临床症状自行缓解。\n3、后期症状\n如果胆囊结石嵌顿持续不缓解，胆囊会继续增大，甚至会合并感染，从而进展为急性胆囊炎，如果治疗不及时，少部分患者可以进展为急性化脓性胆囊炎，严重时可以发生胆囊穿孔，临床后果严重。",
        "prevention": "胆囊结石是可治疗的疾病，对于有症状的胆囊结石患者，如果不及时就医，可能发生严重的并发症，甚至会降低生活质量，严重时可能危及生命。",
        "preventionGeneral": "1、饮食预防\n控制饮食中胆固醇的过多摄入是维持胆汁保持一定稳定性的重要手段。在日常生活中，合理调整膳食结构，一日三餐规律饮食，尤其是早餐，少食含胆固醇较多的脂肪类食物，多食富含高蛋白、高纤维食物及新鲜的蔬菜水果，妊娠期妇女尤其要引起足够的重视。\n2、生活预防\n平时要进行适当的体育锻炼，以防止脂肪在体内过度积存，严格控制体重，每年应定期进行体检。\n3、积极治疗相关疾病\n主要是针对继发性肝内胆管结石而言，肝外胆管结石及胆道蛔虫病是引起肝内胆管结石的主要原因。胆汁引流通畅和控制胆道感染是预防肝内胆管结石的重要环节。胆道蛔虫病是肝胆管结石的重要成因，对其的防治不容忽视。",
