        "phenotypeTplId": 1,
        "introduction": "肌萎缩侧索硬化症(ALS)是一组病因不明，主要累及大脑皮层、脑干和脊髓运动神经元的神经系统变性疾病，损伤2个或者2个以上运动神经元。ALS选择性侵犯脊髓前角细胞、脑干运动神经元、皮质锥体细胞及锥体束的运动神经元导致延髓部、四肢、躯干、胸部及腹部肌肉逐渐无力和萎缩的神经系统变性病。男性患者多见，一般在40～50 岁起病，发病后 3～5年死亡。",
