        "cause": "1、遗传学\n大约5-10％的病例直接从一个人的父母继承。总体而言，ALS患者的一级亲属有发生ALS的风险为1％。\n2、头部受伤\n虽然中度至重度创伤性脑损伤是ALS的风险，但是尚不清楚轻度创伤性脑损伤是否增加。\n3、其他因素\n在没有家族病史的地方，大约90％的病例没有明确原因，证据不确定的可能包括军事服务，频繁吸毒和参与体育运动。",
        "relatedGenes": "1.LIPC基因位于15号染色体上，编码在肝脏中表达的肝脏甘油三酯脂肪酶。 LIPC具有甘油三酯水解酶和配体/桥连因子对受体介导的脂蛋白摄取的双重功能。研究显示LIPC基因可能为ALS易感因素。\n2.DPP6 基因位于7号染色体上，编码作为丝氨酸蛋白酶的肽酶S9B家族成员的单程II型膜蛋白。 该蛋白质没有可检测的蛋白酶活性，最有可能是由于丝氨酸蛋白酶的催化结构域中通常不存在保守的丝氨酸残基。该基因的变异可能与肌萎缩性侧索硬化和特发性心室颤动的易感性相关。\n3.TXNRD1位于12号染色体上，编码吡啶核苷酸氧化还原酶家族的成员。该蛋白降低硫氧还蛋白及其他底物，并在硒代谢和氧化应激保护中发挥作用。已知其在家族性肌萎缩侧索硬化（FALS）的发病机理中起作用。结果表明，TXNRD1可作为ALS的重要修饰基因，并表明额外的硫醇氧化还原系统基因，硫氧还蛋白和过氧氧化还原毒素也应在ALS和其他神经障碍中进行研究。",
