        "phenotypeTplId": 1,
        "introduction": "结节病是一种病因不明的以非干酪性肉芽肿为病理特征的系统性疾病，全身各个器官均可受累，但肺脏和双侧肺门淋巴结受累最为常见。 结节病临床表现多样化，缺乏特异性，体征和症状取决于所涉及的器官，通常没有或只有轻微的症状。通常从20到50岁开始发病，女性比男性更常发生。",
        "advise": "结节病病因未明，因此尚须探讨有效预防措施，大多数人（>75％）只需要用非甾体抗炎药（NSAIDs），如布洛芬或阿司匹林进行症状治疗。对于出现肺部症状的患者，除非呼吸窘迫是破坏性的，否则可观察到活动性肺结节病，无需治疗2〜3个月;如果炎症不自发消退，则进行治疗。药物干预的主要类型包括糖皮质激素，抗代谢物，生物制剂，特别是单克隆抗肿瘤坏死因子抗体，以及最近的特异性抗生素组合和间充质干细胞。",
        "cause": "1、遗传学\n结节病具有遗传易感性，且遗传性因种族而异。约20％的具有结节病的非洲裔美国人会有一个家庭成员发病，而白人的约为5％。另外，在非洲裔美国人中，兄弟姐妹和结节病患者的父母病例的发病风险增加了2.5倍。\n2、传染媒介\n几种感染因子似乎与结节病显著相关，但是没有一种已知的关联特异性足以表明直接的致病作用。主要涉及的感染因子包括分枝杆菌、真菌、borrelia和立克次体。\n3、自身免疫\n常观察到与自身免疫性疾病的关联，这种关系的确切机制是未知的，但一些证据支持Th1淋巴因子流行的假说。",
        "relatedGenes": "1.ANXA11 基因位于10号染色体上，编码膜联蛋白家族的成员，一组钙依赖性磷脂结合蛋白。 膜联蛋白具有独特的N-末端结构域和保守的C-末端结构域，其含有依赖于钙的磷脂结合位点。 编码的蛋白质是来自具有各种自身免疫性疾病的患者的血清识别的56-kD抗原。全基因组关联研究中，膜联蛋白A11（ANXA11）基因的多态性与结节病的易感性相关。至少在白种人中，ANXA11 TH1000388228单核苷酸多态性是结节病中的易感性标志物。\n2.BTNL2基因位于6号染色体上，其功能多态性已被描述为结节病的潜在危险因素。发现临床上不同疾病表型的独立遗传危险因素：BTNL2 TH1035583325在Löfgren综合征或孤立性胸部疾病患者中的等位基因，以及Löfgren综合征或疾病分辨率的HLA-DRB1 * 03。",
