        "symptom": "1、症状和体征\n早期约50%的病例无症状，只是于胸部X线检查时发现。早期常见的呼吸道症状和体征有咳嗽、无痰或少痰、偶有少量血丝痰，可有乏力、低热、盗汗、食欲减退、体重减轻等。病变广泛时可出现胸闷、气急，甚至发绀。肺部体征不明显，部分患者有少量的湿罗音或捻发音。\n2、累及其他器官症状\n皮肤的常见表现为结节性红斑、冻疮样狼疮、麻疹、丘疹等。眼部受累者可有虹膜睫状体炎、急性色素层炎、角膜-结膜炎等。也可累及外周淋巴结、肝脾、骨关节、肌肉、心脏、神经中枢等。",
        "prevention": "预后与结节病的临床类型有关。急性起病者，经治疗或自行缓解，预后较好；而慢性进行性，多个器官功能损害、肺广泛纤维化等则预后较差。",
        "preventionGeneral": "1、对症治疗\n结节病病因未明，因此尚须在专业临床医师的指导下进行相关预防措施，大多数人只需要用非甾体抗炎药，如布洛芬或阿司匹林进行症状治疗。对于出现肺部症状的患者，除非呼吸窘迫是破坏性的，否则可观察到活动性肺结节病，无需治疗2〜3个月，如果炎症不自发消退，则进行治疗。\n2、药物干预\n药物干预措施需在专业临床医师的指导下进行预防，主要类型包括糖皮质激素、抗代谢物、生物制剂，特别是单克隆抗肿瘤坏死因子抗体，以及最近的特异性抗生素组合和间充质干细胞。",
