        "symptom": "1、运动症状\n帕金森病有四种主要运动症状：颤抖、肢体僵硬、动作迟缓、姿态不稳。颤抖是最明显且最为人所知的症状，大约有30%的帕金森病病患在疾病刚开始时不会颤抖，但随着病程进展，多数病患会逐渐产生此症状。肢体僵硬是由于患者肌张力增加，肌肉持续收缩，导致四肢移动困难。运动迟缓是运动执行过程的动作缓慢，是帕金森病早期常见的症状。姿态不稳是帕金森病晚期的典型症状，患者因丧失平衡感而经常跌倒，并常因此骨折。\n2、神经性精神疾患\n帕金森病可能导致轻度到重度的神经性精神疾患，包括言语、认知、情绪、行为和思考混乱，后期可能会发展为痴呆症。相较于一般人，没有认知障碍的帕金森病患者较容易有行为和情绪障碍，且这些患者通常没有痴呆症，最常见的情绪障碍有忧郁、冷漠和焦虑。\n3、其他\n睡眠障碍也是一种可能的帕金森病症状，此外还可能有多汗、尿失禁、严重便秘、干眼症、失去嗅觉、痛觉和感觉异常等症状。",
        "prevention": "帕金森病发病缓慢，待确诊时症状已较明显，本病严重影响生活质量及寿命，对于高发人群定期的进行检查，争取早发现、早诊断、早治疗。",
