        "symptom": "1、学习障碍\n所谓的学习障碍是指，在听、说、读、写、推理、运算，以及在其使用上明显的出现困难情况，而其原因来自中枢神经功能障碍。\n2、对立反抗与行为规范障碍 \n在 ADHD 儿童中，约有 30~50% 出现对立反抗与行为规范障碍的情况，尤其在男童的比率偏高。由于这种儿童与人的互动较敏感，因此当他心情不好时，会向他人破口大骂或推挤，甚至会出现暴力倾向，通常这种儿童个性固执、易怒，且会做出反抗的行为。\n3、忧郁症\nADHD 儿童中，约有 1/3 的比率患有忧郁症。症状有忧郁、沮丧、爱计较、注意力下降、记忆发生障碍、与朋友之间的互动不好、睡眠型态与体重变化、活力不足、自我批评等症状。\n4、抽搐\n抽搐与本身的意志无关，其可分为两类：其一为不自主地反复发出诡异声音之声音型，另一类为持续在脸部与身体部位做出小动作的动作型抽搐。如晃手这些快速而短促的动作，比较复杂的有摸鼻子、碰别人、乱踢腿、作鬼脸等表现，甚至也有的小孩会模仿别人或作出疑似猥亵的动作。\n5、躁郁症\n躁郁症是一种交替极端性的情绪，例如高昂的情绪（躁症）与低落的情绪（忧郁症）交替。大部分会出现在成人期，但也会出现在 10 岁以上的青春期，出现在儿童期的比率非常稀少。\n6、睡眠障碍\n主要症状为睡眠中感到极度的恐怖而被惊吓等，通常会在入睡后 1-2 小时内发生，持续约 1-10 分钟左右，症状有心跳急速加快，大量地流汗，呼吸急迫，一时无法保持清醒状态，早上起床只记得曾发生过非常可怕的事情，但几乎不记得晚上所梦到的内容。",
        "prevention": "根据目前全世界各国的患病率而言，ADHD仍然是一个全球性的问题，需引起高度的关注。",
        "preventionGeneral": "1、运动预防\n定期体育运动，特别是有氧运动，是儿童和成人ADHD的有效补充治疗。能更好的控制行为和运动能力，改进的执行功能（包括关注，抑制控制和规划等认知领域），更快的信息处理速度和更好的记忆。\n2、行为预防\n主要体现在自我管理、时间管理、学校及家庭行为控制等方面，另外还有脑生物反馈训练、中医药、针灸等防治措施。\n3、远离诱因\n避免各种可能的致病因素，对于在婴幼儿和学龄前期就有好哭、少睡、注意力分散、活动过多、冲动任性、倔强等症状的孩子，在进行心理行为矫正的同时，应及时进行提高主动注意能力的早期训练，这有助减少ADHD的发生。",
        "preventionCheckup": "ADHD是通过评估一个人的童年行为和心理发展来确定的，包括排除药物和其他医疗或精神问题的影响。\n1、定量脑电图\n2、自我评价量表",
