        "phenotypeTplId": 1,
        "introduction": "腹主动脉瘤（AAA）是腹主动脉扩张膨出性疾病，主动脉直径大于3cm或比正常直径大50％以上的病理性改变，约85％发生在肾动脉以下，偶尔会发生腹部，背部或腿部疼痛，有时可以通过按摩腹部感觉到大动脉瘤，破裂可能导致腹部或背部疼痛，低血压或意识丧失，甚至导致死亡。最常见于50岁以上，男性和家族史者，具有极高的致死率与致残率。",
        "advise": "1. 戒烟：不吸烟是预防疾病的最佳方式。\n2. 控制动物脂肪的摄入，控制高胆固醇类食物的摄入\n3. 筛查：在美国，推荐使用超声波筛查65至75岁之间的男性吸烟史。英国建议筛选65岁以上的所有男性。一旦发现动脉瘤，通常进行进一步的超声波定期进行随访。",
        "cause": "1、吸烟\n超过90％的发展AAA的人有吸烟史或仍在吸烟。\n2、酒精和高血压\n长期使用酒精及高血压引起的炎症以及导致痔疮、食道静脉曲张等症状的腹部水肿也被认为是AAA的长期原因。\n3、其他原因包括\n感染、创伤、动脉炎和囊性内侧坏死。",
        "relatedGenes": "CDKN2B-AS1基因位于染色体9p21的CDKN2B-CDKN2A基因簇内。基因产物是与polycomb阻遏复合物-1（PRC1）和-2（PRC2）相互作用的功能性RNA分子，导致该簇中其他基因的表观遗传沉默。 该区域是心血管疾病的重要遗传易感性位点，并且还与许多其他病理学有关，包括几种癌症，颅内动脉瘤，2型糖尿病，牙周炎，阿尔茨海默氏病，子宫内膜异位症，老年人虚弱和青光眼 。",
