        "symptom": "1、未破裂前\n疼痛为破裂前的常见症状，多位于脐周及中上腹部。动脉瘤侵犯腰椎时，可有腰骶部疼痛，若近期出现腹部或腰部剧烈疼痛，常预示瘤体濒临破裂。\n2、急性破裂时\n急性破裂的患者表现为突发腰背部剧烈疼痛，伴有休克表现，甚至在入院前即死亡。\n3、破裂后\n若破后入腹膜，出血局限形成血肿，腹痛及失血休克可持续数小时或数天，但血肿往往有再次破裂入腹膜腔致死可能。瘤体还可破入下腔静脉，产生主动静脉瘘，可出现心力衰竭。瘤体偶尔可破入十二指肠引起胃肠道大出血。瘤内偶可形成急性血栓，血栓脱落可造成下肢动脉栓塞。十二指肠受压可发生肠梗阻，下腔静脉受压阻塞可引起周围水肿。",
        "prevention": "主动脉瘤是主动脉壁局部或弥漫性的异常扩张，压迫周围器官而引起症状，瘤状破裂为其主要危险，所以应早期进行相关检查，争取“早发现、早诊断、早治疗”。",
        "preventionGeneral": "1、生活方式改善\n戒烟戒酒，限制动物脂肪、高胆固醇类食物的摄入，限制活动，不宜剧烈活动，避免生气急躁，以减少外因引起腹主动脉瘤的破裂，保证充足的休息，避免长期熬夜。\n2、积极治疗相关疾病\n治疗高血压、高胆固醇等增加患病风险的相关疾病。\n3、加强宣传教育及筛查\n加强疾病知识的宣传教育，使人们更加了解疾病，注重身体健康，定期进行相关检查进行疾病筛查，尤其是有吸烟史的男性，如一旦发现动脉瘤，通常进行超声波定期检查及随访。",
