        "symptom": "1、干性老年黄斑变性\n双眼常同期发病且同步发展。早期（萎缩前期）中心视力轻度损害，甚至在相当长时间内保持正常或接近正常。晚期（萎缩期）中心视力严重损害，有虚性绝对性中央暗点。眼部镜检下有密集或融合的玻璃膜疣及大片浅灰色萎缩区。萎缩区境界变得清楚，其内散布有椒盐样斑点，亦可见到金属样反光。\n2、湿性老年性黄斑变性\n本型的特点是色素上皮层下有活跃的新生血管，从而引起一系列渗出、出血、瘢痕改变。早期（盘状变性前期）中心视力明显下降，其程度因是否累及中心窝而异。中期（突变期）主要特征为黄斑部由于新生血管渗漏，形成色素上皮层或神经上皮层浆液或出血性脱离，视力急剧下降。晚期（修复期）渗出和出血逐渐吸收并为瘢痕组织所替代。",
        "prevention": "其患病率随年龄增长而增高，是当前老年人致盲的重要疾病。由于本病原因还不明确，所以至今尚无有效治疗和根本性的预防措施，所以定期的专科检查显得尤为重要。",
        "preventionGeneral": "1、养成良好的用眼习惯\n户外活动时最好佩戴太阳镜或撑伞，防止阳光直射眼睛，看电视、用电脑时，最好每45分钟休息10分钟，可做眼保健操或望向远处及绿色植物。\n2、饮食调整\n常吃些富含维生素C、维生素E、叶黄素等的食物，如胡萝卜、紫甘蓝、油菜、菠菜、芹菜、韭菜、黄瓜、西兰花、玉米等。研究发现，富含维生素C/E的食物具有清除氧自由基、防衰老的功能，可使中老年人患老年黄斑变性的风险降低43%。临床实验证明，摄取叶黄素和玉米黄素可减少患老年黄斑变性的风险，叶黄素是一种类胡萝卜素，其自身不能在体内合成，所以平时要多吃富含叶黄素的蔬菜、水果。年龄超过50岁的高危人群可每天适量补充叶黄素。戒烟戒酒。\n3、早筛查\n中老年人要重视眼睛方面所表现出来的异常症状，通过早期筛查可以早日确诊疾病。45岁以上的中老年人，每年需要做一次眼科检查。定期的眼科检查不仅有助于早发现老年黄斑变性，也有助于发现白内障等其他眼病。",
        "preventionCheckup": "对于已患有糖尿病、心血管疾患及视力下降严重的高危人群应定期的进行相关检查，尽早发现，尽早给予治疗。\n1、视力、眼压、眼底成像检查\n2、荧光素眼底血管造影、吲哚菁绿脉络膜造影",
