        "caseRate": null,
        "symptom": "1、前驱症状阶段\n前驱症状见于约60%的偏头疼患者，通常在疼痛或先兆出现之前两天至两个小时以内出现，症状如情绪变化、易怒、重性抑郁障碍或欣快、疲倦、特别希望吃到某种食物、肌肉僵硬（特别是颈部肌肉）、便秘或腹泻、对某种气味或噪音敏感等。\n2、先兆阶段\n通常发生在头痛发作之前或发作之时，持续时间不超过60分钟。这些症状可能是视觉上、触觉上或是行为上的，许多人都可能感到多种先兆。\n3、疼痛阶段\n典型的偏头疼是单侧性的、搏动性的，从轻微疼痛慢慢变成剧烈疼痛。头痛发作之初痛感轻微，但随着体力活动的增多，头痛则日益剧烈。但有超过40%的病例中，头痛可能是双侧性的，并伴有颈部疼痛。通常还伴有恶心、呕吐、恐光、恐声、嗅觉敏感、疲乏和易怒的情况。\n4、后期症状阶段\n头痛结束后会出现酸痛的情况，还有人认为思维会受到一定影响，患者还可能会感到疲劳或“宿醉”的感觉，出现头痛、认知难度、消化道症状、情绪变化和虚弱无力的情况。",
        "prevention": "全球来看，约有15%的人群在一生中的某一个时段会受到偏头疼的影响，该病影响广泛，治疗目的主要是减少偏头疼的发病频率、减轻痛感或缩短发病时长，从而提高症状治疗的有效性。",
        "preventionGeneral": "1、生活调整\n平时注意劳逸结合，尽量保持性情豁达、心情舒畅，避免过度疲劳和精神紧张。发病时须静卧，保持安静。\n2、饮食限制\n饮食要有节制，不要过饱或过饥，也不要摄入高脂肪食物和饮酒，如有已知的刺激性饮食，更应避免。控制引起偏头疼的食物如咖啡、巧克力、奶制品、动物脂肪等，其诱发偏头疼占全部食物因素的49. 8%，严格控制此类食物可防止偏头痛发作。此外还有酒精饮料特别是红葡萄酒、白酒，柠檬汁、柑橘、冰淇淋、腌制品、酱油等，都可以诱发偏头疼。 \n3、预防治疗  \n每月头痛发作2～3次者应考虑长期预防性药物治疗，需每天服用，用药后至少2周才能见效，若有效应持续服用6个月，随后逐渐减量到停药。",
        "preventionCheckup": "对于高危人群，尤其是有家族史者，应定期进行相关检查，早发现，早诊断，早治疗。\n1、脑电图检查 、脑血流检查\n2、脑血管造影检查\n3、脑脊液检查\n4、免疫学检查  ",
        "geneticCorrelation": "该病三分之二的病例都有家族遗传的因素，针对双胞胎的研究中，有34%-51%的遗传因素表明他们可能会患偏头疼。",
