        "caseRate": "",
        "symptom": "1、皮损\n皮损为色素脱失斑，常为乳白色，也可为浅粉色，表面光滑无皮疹。\n2、白斑\n白斑境界清楚，边缘色素较正常皮肤增加，白斑内毛发正常或变白。\n3、病变及累及部位\n病变好发于受阳光照射及磨擦损伤部位，病损多对称分布，白斑还常按神经节段分布而呈带状排列。除皮肤损害外，口唇、阴唇、龟头及包皮内侧黏膜也常受累。",
        "prevention": "白癜风应尽早做到规范化治疗，争取早期治疗，初发病或病程短、面积小者，一般均能治愈。一般来说，年龄小、病程短、面积小者易治; 年龄大、病程长、面积大者难治。",
        "preventionGeneral": "1、调摄精神\n保持开朗豁达的胸怀，避免焦躁、忧愁等不良情绪刺激。白癜风不具有传染性，也不会影响身体机能，所以在患病期间一定要保持一个良好健康的心态，以积极乐观的心态面对生活，不要出现焦虑忧愁不安，沉默寡言，烦躁等情绪。\n2、保护皮肤、免受损伤\n衣服宜宽大适身，不可过紧、腰带宜松，避免外伤、摩擦、压迫，洗澡时不可用力搓擦。避免接触酚及酚类化合物以及汽油、油漆、沥青等，避免长时间、强烈日光曝晒，出门前要做好防晒准备，涂上隔离系数强的防晒霜，打上遮阳伞，保护皮肤。\n3、饮食禁忌\n宜多吃富含酪氨酸的食物，如坚果( 白果、核桃、花生、葵花子、 栗子、莲子、南瓜子、松子、西瓜子、杏仁等) 、豆类和豆制品、黑芝麻、动物肝脏等，适量食用一些海贝，海蛤之类的产品。避免维生素C摄入过量，少吃富含维生素C的食物，如西红柿、苹果、橘子、柚子、猕猴桃等，不可过食辛辣刺激性食物以及所谓的“热性食物”或“发物”，戒烟戒酒。",
        "preventionCheckup": "本病发病原因尚不清楚，尚无确定的体检预防措施，如有不适，应及时至专科门诊就诊，根据医嘱行相关专科检查。",
        "geneticCorrelation": "大量流行病学研究结果显示，白癜风存在高度阳性的家族史和家族聚集现象。遗传因素是白癜风发病的重要因素之一，白癜风可能为一种多基因控制的遗传性疾病。",
