        "symptom": "1、神经纤维受损症状\n若脑干及小脑系统的神经纤维受损，可出现复视、吞咽困难、步履不稳、晕眩等症状。若脊髓发炎，可出现运动、感觉、排泄的功能障碍，少数病患还会有癫痫及智能障碍的发生。\n2、预后及复发\n症状的复发常是单独的症状，即只有单独的神经系统受损，症状的发生常在几小时至几天才发生完全。依照定义，症状要持续24到48小时，如果是阵发性症状，必须持续数星期才合乎诊断条件。96%病患在第一次发作时常完全缓解，不过在第一次发作后25%病患一年内会再发生，40%病患五年内会再发生，无论如何，在病程后期复发的频率逐渐减少。",
        "prevention": "多发性硬化症病患，生命长度比起一般人只有轻微影响。多数死因是并发症，如败血症、吸入性肺炎、褥疮等。只有少数病患因脑干生命中枢发炎导致心血管、呼吸系统的影响而死亡。",
        "preventionGeneral": "1、预防感染\n向患者及家属讲明预防感染的重要性，使其充分重视，加强自我保护，预防各种原因的感染。生活中适时增减衣服，尽量避免去人多、空气不流通的公共场所，注意与有传染性疾病的患者隔离。如出现上呼吸道感染等疾病，应尽早遵医嘱进行药物治疗。\n2、加强心理疏导\n让患者学会自我排解抑郁、焦虑情绪，调整心态。避免自我封闭，多与好朋友聊天，欣赏音乐或观看电视节目，进行户外活动，享受大自然美景，从而使自己心情愉快，减轻心理压力。\n3、保持生活规律和环境舒适\n协助患者拟定合理的作息制度，保持生活规律，保证充足睡眠， 劳逸结合。指导患者注意饮食平衡，多吃高蛋白、低脂肪、富含维生素、易消化的清淡食物，做到鱼、鸡、肉、蛋、水果及粗细粮搭配合理。同时给患者创造舒适的环境，增大患者的活动空间，保持病室空气清新。\n4、避免妊娠、流产\n为女性患者介绍安全、有效的避孕方法，防止妊娠、流产。\n5、功能性锻炼\n根据患者的不同症状，指导其采取适当、有效的方法，积极进行功能性锻炼，以预防肌肉萎缩或使萎缩的肌肉得以恢复。",
        "preventionCheckup": "对于高危人群及存在预后较差因子的患者，应定期进行专科检查，避免疾病的进一步恶化。\n1、血常规、血生化、免疫学检查\n2、脑部及嵴髓核磁共振、CT\n3、脑脊液检查\n4、诱发电位波检查",
