        "symptom": "1、疼痛\n关节疼痛是风湿性关节炎的首要症状，全身关节都有可能发生疼痛，但是以大关节受累更为常见，如膝关节、踝关节、肩关节、腕关节等。典型的表现为对称性、游走性疼痛，并伴有红、肿、热的炎症表现。通常急性炎症症状持续2～4周消退，一个关节症状消退，另一个关节的症状又可出现，也有几个关节同时发病的。关节症状受气候变化影响较大，常在天气转冷或下雨前出现关节痛。\n2、肌肉疼痛\n起病时患者可有肌肉酸痛不适、周身疲乏、食欲缺乏、烦躁等症状。\n3、不规律性发热\n风湿出现之前会发生不规则的发热现象，多为轻中度发热，脉搏加快、多汗，与体温不成正比。\n4、皮肤黏膜症状\n有皮下结节、环形红斑等，儿童多见，成人少见。\n5、舞蹈症\n仅见于儿童，女孩多见，患儿先有情绪不宁、烦躁、易怒等精神症状，继而出现无目的的快速动作，做皱眉、噘嘴等怪相，肢体可出现伸直和屈曲、内收和外展、旋前和旋后的无节律交替动作。疲劳及兴奋时明显，休息及镇静时减轻，睡眠时消失。\n6、心脏症状\n由于风湿热活动期以累及关节和心脏为主，因此风湿性关节炎患者常伴有心肌炎、心内膜炎、心包炎等，有心悸、气促、心前区疼痛等症状。",
        "prevention": "虽然近几十年来风湿热的发病率已显著下降，但慢性风湿性关节炎并非少见，平时应积极预防，尤其是高危人群，及时发现，尽早给予专科治疗。",
        "preventionGeneral": "1、注意饮食\n饮食宜清淡，进食高蛋白、高热量、易消化的食物，少吃少食生冷瓜果及虾、蟹等食物，忌食辛辣生冷，多吃温热食物及一些蛋类、奶类、豆类、蔬菜和水果等，荤素搭配。\n2、积极预防控制感染\n如果自身患有一些疾病一定要及时治疗，不要等到诱发别的疾病带来不必要的麻烦，像感冒、鼻窦炎、扁桃体炎、咽炎等感染性疾病，极易诱发类风湿性关节炎发作，所以患者在春季一定要有意识的避免各种感染。\n3、防寒防潮\n患者要关注天气变化，注意自身保暖，避免寒热交替诱发疾病，选择向阳房间，经常通风，保持室内空气清新，温湿度适宜，洗刷要用温水，睡觉前用热水泡脚，促进血液循环，外出要注意关节部位保暖，减少发病次数。积极避免各种关节损伤以及关节受到反复的冲击力或扭力。",
        "preventionCheckup": "该病常累及各个关节，影响生活质量，定期的体检能尽早发现、尽早诊断，及时给予相关治疗。\n1、血常规、红细胞沉降率、C反应蛋白\n2、抗链球菌溶血素O抗体检测\n3、关节液检查\n4、类风湿因子、抗核抗体检查\n5、关节X线及CT",
        "geneticCorrelation": "",
