        "symptom": "1、关节表现\n可分为滑膜炎症状和关节结构破坏的表现，前者经治疗后有一定的可逆性，后者一经出现很难逆转，主要症状表现为晨僵、关节肿痛与压痛、畸形及关节功能障碍。RA病情和病程有个体差异，从短暂、轻微的少关节炎到急剧进行性多关节炎均可出现。\n2、关节外表现\n类风湿结节是本病常见的关节外表现，除此之外，还有类风湿血管炎、肺部受累（肺间质病变、结节样改变、胸膜炎、肺动脉高压），还会涉及心脏、胃肠道、肾、神经系统、血液系统等病变。",
        "prevention": "本病是慢性、进行性、侵蚀性疾病，如未适当治疗，病情逐渐加重发展，减轻关节症状、延缓病情发展、防止和减缓关节的破坏、保护关节功能、最大限度的提高患者的生活质量，是目前的治疗目标，因此早期诊断、早期治疗至关重要。",
