        "symptom": "1、消化系统表现\n腹泻及脓血便是最常见的早期症状，患者还有左下腹或下腹轻至中度的阵痛，此外还伴有腹胀，严重病例还有食欲不振、恶心呕吐等表现。\n2、全身表现\n中、重度患者活动期常有低度至中度发热，高热多提示合并症或见于急性爆发型，还可出现衰弱、消瘦、贫血、低蛋白血症、水与电解质平衡紊乱等表现。\n3、肠外表现\n本病可伴有多种肠外表现，包括外周关节炎、结节性红斑、前葡萄膜炎、口腔复发性溃疡、强直性脊柱炎等。",
