        "preventionGeneral": "1、合理饮食  \n有家族史的人群，尤其要注意饮食，平时饮食应以柔软、易消化、富含营养为原则，少量多餐，补充多种维生素，多食用益生菌及其制品。另外食用含有多不饱和脂肪酸的鱼油、亚麻油以及坚果等，也能抑制和预防UC的炎症过程。勿食生、冷、油腻及多纤维素的食物，戒烟戒酒。\n2、积极控制感染  \n一旦有肠道感染，如出现腹痛、腹泻等症状，应及早治疗，积极寻找潜在的隐匿的感染灶，针对性地控制感染，减少对肠道的刺激，防止转为慢性肠道感染。注意食品卫生，避免肠道感染诱发或加重本病。\n3、调节情志  \n平时要保持心情舒畅，避免精神刺激，解除各种精神压力。加强自我个性修养，学会克制，学会冷静地换位思维，有意识地改变专断、过激的行为，尽量避免不良的精神刺激，平日心情保持舒畅。提高自我调整和放松的能力，尽量远离可能存在较大压力的工作与生活环境。 \n4、培养良好生活习惯  \n高温和高寒环境均会使人体处于应激状态，发生一系列的生理变化，因此避免长时间处于高温或高寒环境，注意四时气候的变化，劳逸结合，生活起居有规律，根据自己体力情况选择适合的运动强度，同时养成定时排便的习惯。 ",
        "preventionCheckup": "对于30岁以上有排便功能紊乱、粘液脓血便、原因不明的贫血、消瘦、腹部包块或肿块者，应高度警惕，定期体检。\n1、血尿便常规、血生化、C反应蛋白\n2、自身抗体检查\n3、结肠镜检查\n4、X线钡剂灌肠检查",
