        "symptom": "1、初始症状\n最初症状好发部位为四肢伸侧，其次为躯干部和头皮、发际。最初症状开始为粟粒大至黄豆大的红色丘疹或斑丘疹。\n2、后期症状\n以后皮疹逐渐扩大增多，并可互相融合成片，而呈点滴状、钱币状、地图状、盘状、蛎壳状等。皮损上覆盖有很厚的灰白色或灰黄色的鳞屑，一般头部严重多见，头发被鳞屑簇集在一起而呈束状，但不脱发。鳞屑容易被刮下，刮除鳞屑后，可见露出一层淡红色半透明地发亮地薄膜。继续轻刮薄膜，则出现筛状的小出血点，鳞屑、薄膜、出血点即为银屑病症状“三标志”。",
