        "preventionGeneral": "1、加强科普知识宣教\n加强科普宣传，使社会和患者对银屑病有正确的认识，解除对银屑病的紧张和恐惧心理，使患者了解一定的心理卫生知识，劳逸结合，避免过度紧张和疲劳，提高修养，消除焦虑，避免急躁，正确处理各种人际关系，树立治愈和控制疾病的信心。\n2、避免疾病的激发因素\n生活中应避免诱发因素，增强锻炼、提高体质，预防上呼吸道感染。冬季型银屑病患者，应争取日光浴，促进皮肤健康。避免皮肤搔抓及使用可以致敏的化妆品 (包括染发剂)，如有外伤，一定要消毒处理，以防感染，引发其他疾病。\n3、合理饮食、注意营养\n多吃水果、蔬菜，忌食辛辣刺激性食物，注意饮水卫生，不吸烟、不饮酒，生活规律，保证足够睡眠时间，保持良好的排便习惯。",
