        "symptom": "1、症状\n早期症状多为腰骶痛或不适、晨僵，也可表现为臀部、腹股沟酸痛，症状可向下肢放射类似坐骨神经痛。常以髋、踝、膝关节炎症为首发症状。其他症状还有腰背痛、腰椎各方向活动受限和胸廓活动度减少，晚期还可伴严重的骨质疏松、易发生骨折。\n2、体征\n常见体征为骶髂关节压痛，脊柱前屈、后伸、侧弯和转动受限，胸廓活动度减低，枕墙距＞0等。",
        "prevention": "目前尚无肯定的疾病控制治疗方法，主要为缓解症状，保持良好的姿势和减缓病情进展，治疗原则应视病情严重程度、预后指征和患者的期望值而定。",
        "preventionGeneral": "1、宣教\n对抗该疾病的最好方法还是防治结合，早发现早治疗，患者宣教是成功治疗的关键。该病的早期重视和发现非常关键，一旦出现疑似强直性脊柱炎的症状，应及早就医。 \n2、生活方式调整\n在日常生活中维持正常姿势和活动能力，注意行走、站立、坐卧时的正确姿势，挺胸收腹，睡觉时不用枕头或用薄枕，睡硬木板床。进行适当的体育锻炼，比如深呼吸、游泳、颈部和腰部的运动等，以保持脊柱的生理曲度，避免过度负重和剧烈运动。消除紧张、抑郁、恐怖的心理，保持积极向上的乐观情绪。\n3、热疗\n如洗热水澡或泡温泉等，增加体内的血液循环使肌肉放松，从而减轻疼痛。 ",
        "preventionCheckup": "本病影响正常的生活和工作，对于高危人群应定期进行体检，以便早发现、早诊断、早治疗。\n1、血沉、C反应蛋白、免疫学检查、血常规、肝功能、心肌酶检查\n2、骶髂关节X线、CT、MRI\n3、骶髂关节活检",
