        "symptom": "1、全身症状\n活动期患者大多数有全身症状，可出现各类型的发热，尤其以低、中热为主，此外尚可有疲倦、乏力、体重下降等。\n2、累及症状\n该病还将在皮肤与黏膜、肌肉骨骼、肾、心血管、肺、神经系统、消化系统、血液系统、眼等出现相应的症状，如皮疹、红斑、溃疡、关节痛、细胞炎、胸腔积液、神经精神狼疮、食欲减退、呕吐腹痛、眼底变化等。\n3、其他\n该疾病的患者还可出现浆膜炎、抗磷脂抗体综合征、干燥综合征等。",
