        "preventionGeneral": "1、加强教育\n加强宣传教育，及时了解SLE的基本知识，如临床表现、诊断、治疗及预后等，认识到SLE是不能彻底根治的，需要长期坚持治疗，树立正确对待疾病态度，积极配合治疗。避免阳光照射、感染、妊娠、手术、饮食不当、劳累、精神创伤等原因诱发和加重病情。\n2、心理指导\n由于SLE病程长，症状反复发作，病人往往存在焦虑、恐惧、抑郁、悲观、失望心理，这些心理因素均直接影响病人的生理和病理过程，降低治疗效果，而且病人的情绪可直接影响免疫系统，情绪波动等精神因素是SLE发病和病情反复诱发因素之一。故应及时给予心理疏导和提供帮助，适当参加体育活动，保持积极乐观的情绪。\n3、日常生活指导\n日常要避免日晒和紫外线照射，外出时应撑遮阳伞或戴宽边帽，穿浅色长袖上衣和长裤；冬天注意保暖，避免受凉感冒，避免到人群聚集地；每天用温水洗脸和洗澡，保持皮肤、口腔、会阴清洁，避免使用刺激性的化妆品和染发剂；按时作息，生活规律，避免精神创伤和刺激；急性期要卧床休息，缓解期适当活动，以不引起关节疼痛和疲劳为度；节制房事，计划性怀孕（病情稳定１年以上，并在专科医生及妇产科医生指导下可以考虑怀孕生子）。\n4、饮食指导\n饮食宜清淡，以低盐、低脂、低糖、高优质蛋白、高维生素饮食为主，宜从含钙食物中补充钙，可补充碳酸钙以促进钙吸收，避免食用具有增强光敏感作用的食物及刺激性食物。",
        "preventionCheckup": "早发现、早诊断、早治疗对于该病的预后尤为重要，应定期的进行相关检查，尽早予以治疗。\n1、血尿常规、肾功能、免疫学检查\n2、自身抗体、补体\n3、狼疮带试验\n4、肾活检病理\n5、X线、CT",
