        "symptom": "1、常见症状\n甲状腺呈弥漫性、质地硬韧的、无痛的轻度或中度肿大，可有轻压痛，甲状腺表面可以是光滑的，也可以是不光滑的，有的病例有不定的结节。颈部局部压迫和全身症状不明显，常有咽部不适感，甲状腺功能正常或偏低，少数患者有浸润性突眼，个别病人有胫前黏液性水肿。 \n2、甲状腺功能异常\n就诊时大约50％的患者甲状腺功能正常，约40％～45％的患者甲状腺功能减退，5％～10％的患者甲状腺功能亢进。甲状腺功能减退症状有畏寒、怕冷、食欲减退、大便秘结等，体征为皮肤毛发干粗、黏液性水肿(非凹陷性水肿)、心动过缓等。甲状腺功能亢进症状有怕热、多汗、食欲亢进、大便增多、心悸、情绪激动、消瘦、乏力等，体征包括皮肤潮湿、心动过速、手颤等。 \n3、伴发疾病\n本病伴有其他自身免疫病的发生率比一般人高，这些疾病诸如肾上腺皮质功能不全、斑秃、胆汁性肝硬化、糖尿病、甲状旁腺功能减退症、恶性贫血及结缔组织病(类风湿关节炎、系统性红斑狼疮、系统性硬化及干燥综合征等)。",
        "prevention": "本病与自身免疫相关，尚无明确的预防方案，且本病常合并多种自身免疫性疾病，需定期进行专科检查，以便早发现、早诊断、早治疗。",
        "preventionGeneral": "1、调节饮食\n饮食应偏于甘凉滋润，宜多吃滋阴清热生津的食物，如丝瓜、梨、藕、芹菜、黄花菜甲鱼等，口舌干燥者可常含用话梅或常饮酸梅汁、柠檬汁等生津解渴饮料。应避免进食辛辣刺激的饮料和食物，以防助燥伤津，加重病情。忌用咖啡、茶、各类油炸食物、羊肉、狗肉以及姜、葱、蒜、 辣椒、胡椒等。戒烟戒酒。\n2、精神调摄\n劳逸适度，保证充足的睡眠，避免过劳，注意精神调摄，保持乐观的精神状态，避免精神刺激和急躁大怒。平时应慎起居，适寒温，以防六淫外邪的侵袭。 ",
        "preventionCheckup": "定期的体检对于疾病的预防尤为重要，尤其是女性。\n1、甲状腺功能、血清蛋白、血沉、血尿生化\n2、抗甲状腺抗体测定\n3、甲状腺扫描、甲状腺组织细胞学检查",
        "geneticCorrelation": " 基因HLA-Ⅱ、CTLA-4在甲状腺相关疾病中起着重要作用。",
