        "caseRate": null,
        "symptom": "1、隐性期\n早期无明显临床症状，甲状腺功能正常，无甲状腺肿或甲状腺轻度肿大，TPOAb阳性，甲状腺内有淋巴细胞侵润。\n2、甲状腺功能减低期\n临床出现亚临床甲减或显性甲减，甲状腺内有大量淋巴细胞侵润，滤泡破坏，甲状腺中度肿大，质地坚硬，多数病例以甲减症状或甲状腺肿首次就诊。\n3、甲状腺萎缩期\n临床显性甲减，甲状腺萎缩。",
        "prevention": "桥本氏甲状腺炎在发展过程中，早期并非没有特殊感觉，常被患者忽视，未能及时就医，造成治疗的延误，所以定期的体检是早期发现疾病的主要手段。",
        "preventionGeneral": "1、增强体质\n加强锻炼，促使气机调畅，血脉流通，从而增强体质，预防疾病的发生。\n2、调畅情志、劳逸结合\n桥本氏甲状腺炎多以长期情志不畅为主要病因，应加强心理疏导。部分桥本氏甲状腺炎患者发病前，确有劳累致体虚的病史，应适度劳作。\n3、低碘饮食  \n高碘饮食可能是诱发桥本氏甲状腺炎发病的主要环境因素。有自身免疫性甲状腺疾病家族史者应避免摄入过量的碘。饮食上，患者应避免食用含碘丰富的食物，如紫菜、海带、海鱼、海蛰 皮等，尽量食用无碘盐，含碘药物也应避免使用。 ",
        "preventionCheckup": "对于高危人群，尤其是有家族史的人群，定期的体检对于早期发现疾病尤为重要。\n1、甲状腺功能、甲状腺免疫学检查\n2、碘131摄取率\n3、甲状腺超声、甲状腺CT/MRI\n4、甲状腺穿刺细胞学检查",
        "geneticCorrelation": "在桥本氏甲状腺炎患者中，常见家族甲状腺机能紊乱病史，在同卵双胞胎的研究中，基因的强相关一致性达到38-55%，说明此病具有高遗传性。",
