        "caseRate": "",
        "symptom": "1、早期症状\n早期、轻度的肥胖多无症状。\n2、中度肥胖\n中重度肥胖可引起气急、关节痛、肌肉酸痛、体力活动减少以及焦虑、忧郁等。\n3、并发症\n肥胖还可伴有多种并发症，如睡眠性呼吸暂停综合征、胆囊疾病、高尿酸血症等。",
        "prevention": "肥胖会增加心血管疾病、2型糖尿病、睡眠性呼吸暂停综合征、某些癌症、退化性关节炎及其他疾病的发生机会。肥胖是一种很常见的可预防疾病，也是21世纪最重要的公共卫生问题之一。",
        "preventionGeneral": "1、饮食控制\n遵循“低脂、低碳水化合物、低热量以及极低热量”饮食原则，吃饭应细嚼慢咽，不宜较快，减少高糖食物的摄入，多食新鲜的蔬菜及水果，按时就餐，减少夜宵及零食摄入。\n2、增强体育锻炼\n制定严格的运动方案，定期按时的进行锻炼，如步行、慢跑、有氧操、舞蹈、骑自行车、游泳、跳绳、爬楼梯等。\n3、建立健康的生活方式\n保证充足的睡眠，善于调节心理压力，保持稳定情绪，对减肥要有信心，戒烟戒酒。",
        "preventionCheckup": "肥胖症的诊断及辅助检查比较简单明确，需定期关注以下检查。\n1、BMI、腰臀比、体脂率\n2、血脂、血糖、肝肾功能\n3、肝脏及血管彩超",
        "geneticCorrelation": "肥胖症有家族聚集倾向，与肥胖基因有关，有一个研究表明肥胖父母的后代有80%的可能是肥胖症患者，而体重正常父母的后代只有10%是肥胖症患者。",
