        "symptom": "1、无症状期\n多数患者发作前无明显征兆，仅有波动性或持续性高尿酸血症，至出现症状可长达数年或数十年，有些可终身无症状，随着年龄的增长，患病率也逐渐增加。\n2、急性关节炎期\n该期多在午夜或清晨突然起病，多呈剧痛，数小时内出现受累关节的红肿热痛和功能障碍等，秋水仙治疗后关节炎症状可迅速缓解，还可有发热表现，初次发作呈自限性，数日内自行缓解，此时受累关节局部皮肤出现脱屑和瘙痒。\n3、痛风石及慢性关节炎期\n痛风石是痛风的特征性临床表现，常见于耳廓、指间和掌指关节，常为多关节受累，表现为肿胀、僵硬、畸形和周围组织的纤维化和变性，严重破溃时，可有豆腐渣样的白色物质排出。\n4、肾脏病变\n痛风性肾病常起病隐匿，早期仅有间歇性蛋白尿，晚期可有肾功能不全，表现为水肿、高血压、血尿素氮和肌酐升高。尿酸性肾结石病表现为痛风患者肾有尿酸结石，呈泥沙样，常无症状，结石较大者可发生肾绞痛、血尿等。",
        "prevention": "痛风是一种终身性疾病，无肾功能损害及关节畸形者，经有效治疗后可正常工作及生活，急性关节炎和关节畸形会严重影响到患者生活质量，所以定期的体检对于发现本病尤为重要。",
        "preventionGeneral": "1、饮食习惯\n控制饮食总热量，限制饮酒及高嘌呤食物的大量摄入，每日可增加一些富含维生素的蔬菜及新鲜水果，多饮水可增加尿酸的排泄。\n2、严格控制体重\n减少高脂肪食物摄入，控制体重，加强运动，减少肥胖症引发的疾病。\n3、改善生活坏境\n远离含有铅的生活及工作环境。",
        "preventionCheckup": "痛风影响活动功能，对于高危人群要定期检查，及早发现、早治疗，减轻患者痛苦。\n1、血尿酸、尿尿酸、尿酸盐检查\n2、滑囊液或痛风石内容物检查\n3、关节X线、CT与MRI检查",
        "geneticCorrelation": "多有遗传性，有痛风家族史者占10%～20%。也与基因有一定的关系，60％的血尿酸浓度变化与基因有关。",
