        "caseRate": null,
        "symptom": "1、症状\n为发作性伴有哮鸣音的呼气性呼吸困难或发作性胸闷和咳嗽，严重者被迫采取坐位或呈端坐呼吸，干咳或咳大量白色泡沫痰，甚至出现发绀等，有时咳嗽为唯一症状，可在数分钟内发作，经数小时或数天后自行或经药物治疗后缓解。常在夜间和凌晨发作及加重是哮喘的特征之一。\n2、体征\n发作时胸部呈过度充气状态，有广泛的哮鸣音，呼气音延长，心率增快、奇脉、胸腹反常运动和发绀经常出现在严重哮喘患者中。\n3、并发症\n发作时可并发气胸、纵膈气肿、肺不张，长期反复发作和感染或并发慢支、肺气肿、支气管扩张、肺纤维化和肺源性心脏病等。",
        "prevention": "采取以预防哮喘发展措施的有效证据目前还很薄弱，尤其对病情较轻的儿童来说，若能够早期给予治疗，预后尚可。",
        "preventionGeneral": "1、远离过敏原\n定期进行过敏原检测，约30%-40%的支气管哮喘可查出过敏原。如尘螨、猫狗等动物的皮垢、霉菌、花粉、牛奶、禽蛋、蚕丝、羽毛、飞蛾、棉絮、真菌等都是重要的过敏原。注意饮食，一般鲜海鱼、虾、蟹、秋茄等均易引起过敏发喘，哮喘患者应避免食用，戒烟戒酒。\n2、避免非特异性理化因子刺激\n如吸入烟、尘和植物油、汽油或油漆等气味以及冷空气，可刺激支气管黏膜下的感觉神经末梢，反射性地引起迷走神经兴奋和咳嗽，在气道高反应的基础上导致支气管平滑肌痉挛。\n3、防止呼吸道感染\n感冒和上呼吸道感染是最常见的诱因，冬春季节或气候多变时更为明显。呼吸道感染，尤其病毒感染更易引致小儿哮喘发作。\n4、避免过度劳累\n突击性强烈的或长时间的体力劳动，紧张的竞技性运动，均可诱发哮喘，适当的进行体育锻炼。\n5、保持情绪稳定\n情绪波动可以成为诱因，诸如忧虑、悲伤、过度兴奋甚至大笑也会导致哮喘发作。",
        "preventionCheckup": "对哮喘的诊断通常基于症状的类型、随时间推移对治疗的反应及呼吸量测定法。医学上对哮喘的分类依据是发病频率、一秒内用力呼吸量和呼气流量峰值。\n1、血常规\n2、呼吸量测定法、支气管激发试验阳性、支气管舒张试验阳性\n3、昼夜PEF变异率≥20%\n4、肺功能检查、特异性过敏原检测",
        "geneticCorrelation": "家庭遗传是哮喘发病的重要风险因素，因为有多种不同基因使病因变得复杂，如果一个同卵双生胎中的一人感染了，另一个人感染的几率会达到25%。",
