        "phenotypeTplId": 1,
        "introduction": "脑动脉瘤好发于脑动脉分叉和主干的分支处，由于此处动脉壁的肌层先天发育缺陷，同时又是受到血液冲击最大的地方。在长期血流的压力和冲击力的作用下，使此处动脉壁的薄弱点向外突出，逐渐扩张，从而形成颅内动脉瘤，是引起蛛网膜下腔出血的最常见原因。以颈内动脉颅内段多发，其次为大脑前动脉和大脑中动脉，大脑后动脉较少见。在脑血管意外中，仅次于脑血栓和高血压脑出血，位居第三。",
        "advise": "目前尚无明确预防其发生的方法。建议存在高危因素的人群，定期进行脑血管检查，以便能够在动脉瘤破裂出血前发现病变并给于恰当的治疗。平时应当对危险因素加以控制如高血压、肥胖等，从而降低动脉瘤的发生率。",
        "cause": "1、生活方式\n生活方式疾病包括高血压、吸烟、过度酒精、中毒和肥胖与脑动脉瘤的发展有关，此外可卡因使用也与颅内动脉瘤的发展有关。\n2、其他因素\n其他因素如动脉粥样硬化、头部创伤、感染等都与该疾病的发生有一定的相关性。",
        "relatedGenes": "CDKN2B-AS1基因位于9号染色体上，位于染色体9p21的CDKN2B-CDKN2A基因簇内。该区域是心血管疾病的重要遗传易感性位点，并且还与许多其他病理学有关，包括几种癌症，颅内动脉瘤，2型糖尿病，牙周炎，阿尔茨海默氏病，子宫内膜异位症，老年人虚弱和青光眼 。",
