        "symptom": "1、破裂前\n在较大的动脉瘤破裂之前，患者可能会表现出突发性和异常严重的头痛、恶心、视力障碍、呕吐和意识丧失等症状，或者根本无症状。\n2、破裂时\n如果动脉瘤破裂，血液就会流到大脑周围的空间，这被称为蛛网膜下腔出血。其发作通常是突发的，没有前驱症状，经典地表现为比以前的头痛更糟的“雷霆头痛”。破裂动脉瘤的症状可包括，突然的头痛可以持续几个小时到几天、恶心和呕吐、嗜睡、混乱、意识丧失、视觉异常、假性脑膜炎等。",
        "prevention": "对于脑动脉瘤，目前没有能够预防其发生的办法，对存在高危因素的人群，建议定期进行检查，以便能够在动脉瘤破裂出血前发现病变并给予恰当的治疗。",
        "preventionGeneral": "1、生活方式改变\n戒烟戒酒，遵循“低盐低脂低糖”及清淡的饮食习惯，减少动物脂肪及高胆固醇、高糖食物的摄入，加强运动，控制体重，减少肥胖，规律作息，保证充足的睡眠。\n2、积极预防相关疾病\n积极预防相关疾病如高血压、高血脂、糖尿病、动脉粥样硬化、头部创伤、感染等疾病的发生。",
        "preventionCheckup": "本病病程隐匿，起病突然，一旦发病致残/死率极高，因而被称为颅内的“不定时炸弹”，是最危险的脑血管病之一，应定期进行相关检查，预防疾病的发生及发展。\n1、血尿常规、血生化、血糖、血脂、血压\n2、脑部CT、MRI、多普勒超声检查\n3、数字减影血管造影（DSA）",
        "geneticCorrelation": "有家族性颅内动脉瘤的患者一级亲属的患病率为20%，女性、年龄大于 30、有吸烟或高血压史的成员更容易发病。",
