        "symptom": "1、典型症状\n主要为多尿症、烦渴、多食症以及不明原因的体重减轻。\n2、其他症状\n包括视野模糊、皮肤瘙痒、周围神经病变、反复阴道炎、疲劳等。少部分的患者会出现高渗性高血糖状态，此类患者会产生高血糖伴有意识水平下降，以及低血压的情况。\n3、并发症\n糖尿病酮症酸中毒、心血管疾病、中风、糖尿病视网膜病变、肾功能衰竭、截肢。",
        "prevention": "糖尿病预防及治疗强调须早期和长期、积极而理性以及治疗措施个体化的原则。",
        "preventionGeneral": "1、饮食结构调整\n根据自身情况控制总热量及糖类食物，避免高脂肪、高热量、高糖食物的摄入，多食蔬菜水果及膳食纤维食物，控制蛋白质的摄入，防止和纠正肥胖，戒烟限酒。\n2、有规律的适当运动\n尤其是肥胖者，适当的运动有利于减轻体重、提高胰岛素敏感性，若有心脑血管疾病者，应按照自身情况妥善安排活动。\n3、合理使用药物\n避免或少用对糖代谢不利的药物。\n4、积极治疗相关风险疾病\n积极发现和治疗高血压、高血脂和冠心病。",
        "preventionCheckup": "糖尿病患者应严格监测相关数据并定期进行相关专科检查。\n1、血生化、尿常规\n2、空腹血糖、随机血糖、糖化血红蛋白、电解质、血肌酐\n3、口服糖耐量试验\n4、胰岛素释放实验、C肽释放实验",
