        "symptom": "1、原发肿瘤引起的症状和体征\n咳嗽为早期症状，多为无痰或少痰的刺激性干咳，还有血痰或咯血，呼吸困难，气短喘息，肿瘤组织坏死时可引起发热，消瘦为恶性肿瘤的常见症状之一。\n2、肺外胸内扩展引起的症状和体征\n近半数患者可有模糊或难以描述的胸痛或钝痛，当癌肿压迫喉返神经时可发生声音嘶哑，压迫食管时可引起咽下困难，此外还有不同程度的胸水、上腔静脉阻塞综合征及Horner综合征。\n3、胸外转移引起的症状和体征\n转移至中枢神经系统时可引起颅内压增高，出现头痛、恶心、呕吐等症状，转移至骨骼时可引起骨痛或病理性骨折，转移至腹部胰腺时可以起胰腺炎症状或阻塞性黄疸，此外还常转移至锁骨上淋巴结。\n4、胸外表现\n主要有肥大性肺性骨关节病、异位促性腺激素、分泌促肾上腺皮质激素样物、神经肌肉综合征、高钙血症及类癌综合征等。",
        "prevention": "肺癌的预后与确诊时的临床分期密切相关，因此争取“早期发现、早期诊断、早期治疗”，是降低肺癌死亡率的重要措施。",
        "preventionGeneral": "1、戒烟及避免被动吸烟  \n戒烟及避免吸二手烟是预防肺癌发生的有效办法。\n2、避免职业暴露   \n加强职业接触中的劳动保护，远离电离辐射等有助于减少肺癌发病的危险。\n3、减少大气污染    \n大气污染是城市较农村肺癌发病率高的因素之一，保护环境、减少大气污染是降低肺癌发病率的重要措施之一，同时外出时应做好防护。\n4、积极治疗肺部疾病\n积极治疗肺部基础疾病，如肺结核、尘肺、肺部瘢痕病灶等，增强机体免疫力，降低基础疾病致癌的概率。\n5、其他  \n多吃新鲜蔬菜、水果，少吃煎炸烤熏食品。一些研究表明，较多的食用含β胡萝卜素及维生素A的蔬菜和水果，可适当的减少肺癌的危险性。",
        "preventionCheckup": "对有上述高危风险因素之一且肺癌综合风险等级评定为“偏高”者，应在专业临床医生指导下，每年做1-2次以下专科检查：\n1、胸片\n2、肺部CT\n3、痰脱落细胞检查\n4、肿瘤标志物\n5、纤维支气管镜",
