        "symptom": "1、早期症状\n早期胃癌多无症状，或仅有一些非特异性消化道症状。\n2、进展期\n进展期胃癌最早出现的症状是上腹痛，常同时伴有纳差、厌食、体重减轻，而这种腹痛不能被进食或服用抑酸剂缓解。患者常有早饱感及软弱无力。\n3、发生合并症或转移时\n贲门癌累及食管下段时可出现吞咽困难，并发幽门梗阻时可有恶心呕吐，溃疡型胃癌出血时可引起呕血或黑粪，继之出现贫血，转移至肝时可引起右上腹痛，转移至肺可引起咳嗽、呃逆、咯血等。\n4、体征\n早期无明显体征，进展期在上腹部可扪及肿块，有压痛，肿块多位于上腹偏右相当于胃窦处。转移至肝可致肝肿大及出现黄疸，腹膜转移时可出现腹水，移动性浊音阳性，远处淋巴结转移时，可扪及Virchow淋巴结，质硬不活动。",
        "prevention": "胃癌的发展较隐匿，未能及时发现并治疗，对高危人群进行筛查，以期早期诊断，提高胃癌生存率。胃癌的治疗效果取决于疾病的分期，即肿瘤生长的大小，对胃壁的浸润程度及是否侵犯周围的器官，淋巴结和身体的其他部位。",
        "preventionGeneral": "1、饮食\n养成良好的进食习惯，细嚼慢咽，不吃烫食，少吃质硬粗糙的食物。低盐饮食，尽量少吃或不吃盐腌及煎炸熏烤食物，如泡菜、鲜肉、火腿、腊肉、熏、烧烤等，严禁食入霉变食品，多吃新鲜蔬菜水果。\n2、预防和治疗幽门螺杆菌（HP）感染\n采取适当的公共卫生措施改善卫生条件是降低Hp感染流行的关键，治疗Hp感染是胃癌化学预防的潜在措施。目前建议，至少应在一级亲属患有胃癌的人群中检测并治疗Hp感染。\n3、普查\n在胃癌高发地区，高危人群应定期普查，提高早期诊断率及早进行治疗。",
        "preventionCheckup": "因胃癌病情发展隐匿，对于已患有慢性萎缩性胃炎、饮食结构不合理的高危人群，除进行生活方式的改变外，应定期进行专科门诊定期检查。\n1、幽门螺旋杆菌检测\n2、胃镜、X线钡餐检查\n3、腹部超声及CT\n4、胃组织活检、胃腔脱落细胞学检测",
        "geneticCorrelation": "胃癌有明显的家族聚集倾向，家族发病率高于普通人群的2-3倍，浸润型胃癌有更高的家族发病倾向。",
