        "symptom": "1、腹痛\n多数患者有腹痛并常为首发症状，早期腹痛较轻或部位不清，以后逐渐加重且腹痛部位相对固定。常为持续性钝痛或钻痛，剧烈者常有持续腰背部剧痛。\n2、黄疸\n是胰头部癌的突出症状，病程中约90%出现黄疸，但以黄疸为首发症状者的不多，黄疸的特征为肝外阻塞性黄疸，持续进行性加深，伴皮肤瘙痒，尿色如浓茶，粪便呈陶土色。\n3、体重减轻\n90%的患者有迅速而明显的体重减轻，其中部分患者可不伴腹痛和黄疸，晚期常呈恶病质状态。\n4、其他症状\n可有食欲不振和消化不良、恶心呕吐、腹胀、腹泻等症状，还因长期疾病影响，会有精神抑郁、焦虑、失眠等问题。",
        "prevention": "胰腺癌患者病变初期缺乏特异性体征，出现体征时多为进展期或晚期，因此要定期体检，做好预防，早发现早治疗。",
        "preventionGeneral": "1、饮食\n戒烟戒酒，饮食中增加水果、蔬菜及谷类的比例，同时减少摄入高脂肪、高蛋白质食物。\n2、运动\n坚持适量的体育锻炼，保持健康的体重，注意膳食与体育活动的平衡。\n3、减少或防止相关性疾病发生\n采取相应措施防止发生糖尿病、慢性胰腺炎和胆石症等疾病，这些病症均可导致胰腺癌的发生风险增加。",
