        "symptom": "1、早期症状\n早期症状不典型，易被忽略。主要为胸骨后不适、烧灼感、针刺样或牵拉样痛，进食通过缓慢并有滞留的感觉或轻度哽噎感，时轻时重，持续时间长短不一。\n2、中晚期症状\n中晚期症状主要有进行性咽下困难，食物反流，咽下疼痛，其他症状如慢性脱水、营养不良、消瘦与恶病质等。",
        "prevention": "如果已存在食管癌的高危险因素，长期存在吞咽疼痛、胸闷或烧心、原因不明的体重减轻、声嘶、呃逆、肺炎和高钙血症等症状，应尽早到正规医院相关科室进行诊断及治疗，早诊断才能获得完善系统的治疗。",
        "preventionGeneral": "1、建立健康生活习惯\n戒烟戒酒，避免吸烟和酗酒是降低发病风险的最佳办法。禁食一些含致癌物质的食物，如含亚硝胺类化合物和真菌霉素的霉变食物。\n2、饮食结构调节\n少食多餐，避免食用过硬或粗糙、过烫、辛辣及油炸等刺激性食物。多食一些水果蔬菜及富含维生素及矿物质、膳食纤维的饮食。美国国家癌症研究所指出，提高饮食中十字花科（圆白菜、西兰花、花椰菜、布鲁塞尔豆芽）、绿色黄色蔬菜和水果比例可以降低食管癌的发病风险。",
        "preventionCheckup": "对于已有食管癌类似症状的患者，应积极进行检查确诊，以获得早期治疗。\n1、食管黏膜脱落细胞检查\n2、食管内镜与活组织检查\n3、食管X线、CT检查\n4、超声内镜检查",
        "geneticCorrelation": "食管癌发病表现家族性聚集现象，在我国高发地区，本病有家族史者较普通人患病风险高达25%-50%，其中父系最高，母系次之，旁系最低，目前认为是癌基因激活或抑癌基因失活的基因变化所致。",
