        "symptom": "1、便血\n是结肠癌最早和最常见的表现。轻者仅表现为偶尔有少量出血，须经过实验室测试才知道有少量出血，重者可表现有粘液血便、粘液脓血便或鲜血便，常被误诊为痢疾或痔疮出血而贻误了确诊时机。\n2、腹痛\n部分病人以定位不确切的持续隐痛为首发或突出症状，部分病人仅腹部不适或腹胀感。\n3、排便习惯改变\n多为排便次数或粪便性状改变，如大便次数突然增多，粪便的性状如水样，或伴有里急后重感，尤其是发生于青年人时。 \n4、贫血\n男性病人，尤其是无其他原因的失血，亦无肠寄生虫病的人，如发现进行性缺铁性贫血，应想到有胃或大肠癌症的可能性。",
        "prevention": "开展大肠癌的早查早治有着非常重要的现实意义。",
        "preventionGeneral": "1、膳食结构的改善\n减少高动物蛋白、高脂肪、过于精细的食物、少纤维素及精制米面的摄入。多吃含纤维素多的蔬菜水果，如菠菜、芹菜、水果等，以保持大便通畅。\n2、养成良好的排便习惯\n养成清晨定期排便的习惯，减少便秘的发生，使粪便在肠道停留的时间减少，进而降低诱发炎性反应、坏死的几率，最终降低肠道癌变。\n3、生活习惯的改变\n定期进行运动，避免长期的久坐。规律作息，减少长期的熬夜。注意个人饮食卫生，减少肠道疾病的发生。",
        "preventionCheckup": "尽管任何年龄都可以罹患结直肠癌，但90％以上病例年龄大于40岁，所以通常讲40岁以上的人应该开始例行的体检，以及时发现可能的癌变。\n1、血生化、血尿便检查\n2、直肠指检\n3、结肠镜检查\n4、钡灌肠及X线检查",
