        "symptom": "1、乳房肿块\n乳腺癌的显著症状通常是触及不同于乳房其余组织的肿块。\n2、乳头溢乳及乳头皮肤溃烂\n乳头溢液，乳房或腋窝部分的持续疼痛，以及腋下或锁骨周围肿胀。除此之外还可有乳房组织不同的增厚，一个乳房变大或变小，乳头变化位置或形状或变得倒置，乳头上或周围的皮疹。\n3、典型皮肤改变\n皮肤呈橘皮样改变。\n4、其他改变\n腋窝淋巴结中发现的肿瘤也可能提示乳腺癌。",
        "prevention": "对于乳腺癌的早期诊断应具有良好的心态，不应该“漠视”，要“重视”，但是不要“恐惧”。",
        "preventionGeneral": "1、生活方式改变\n保持健康的体重，戒烟戒酒，积极锻炼和母乳喂养孩子可以减少乳腺癌的风险。轻度步行等适度运动对预防本病大有好处。高水平的身体锻炼将乳腺癌的风险降低约14％。摄入柑橘类水果可降低10％的风险。海洋ω-3多不饱和脂肪酸及大豆食品可能降低风险。\n2、高危人群的药物干预\n选择性雌激素受体调节剂（如他莫昔芬）可降低乳腺癌的风险，但增加血栓栓塞和子宫内膜癌的风险，死亡风险没有整体变化，因此，不推荐在平均风险的妇女中预防乳腺癌，但可以为高风险的妇女提供。\n3、合理使用激素类药物\n避免滥用激素类药物，如有需要，应在正规医院专科临床医生的指导下用药。",
        "preventionCheckup": "对于标记为乳腺癌高危人群的人，定期的乳腺癌专项检查对乳腺癌高风险人群意义重大。\n1、乳腺彩超\n2、乳腺钼靶\n3、乳腺X线、乳腺MRI\n4、乳腺穿刺活检",
