        "symptom": "1、血尿\n血尿是膀胱癌最常见的症状，尤其是间歇全程无痛性血尿，可表现为肉眼血尿或镜下血尿，血尿出现时间及出血量与肿瘤恶性程度、分期、大小、数目、形态并不一致。\n2、膀胱刺激症状\n尿频、尿急、尿痛，有患者以膀胱刺激症和盆腔疼痛为首发表现，常与弥漫性原位癌或浸润性膀胱癌有关。\n3、其他症状\n其他症状有输尿管梗阻所致腰胁部疼痛、下肢水肿、盆腔包块、尿潴留。有的患者就诊时即表现为体重减轻、肾功能不全、腹痛或骨痛，均为晚期症状。",
        "prevention": "应尽早从生活方式上得以转变并进行相关专科检查。",
        "preventionGeneral": "1、保持合理的膳食结构\n多摄食蔬菜、水果。世界卫生组织进行的一项2008年的研究结论，“特定的水果和蔬菜可以减少膀胱癌的风险”，柑橘类水果和十字花科蔬菜被认为具有可能的保护作用。\n2、戒烟\n香烟中含有尼古丁、焦油等多种特异性亚硝胺类毒性致癌物。\n3、加强职业防护\n对于长期接触芳香胺类物质，如橡胶、塑料和化学药品的人群，易患膀胱癌，其发病危险与接触芳香胺类物质的时间长短、剂量大小和密切程度成正比，应加强自我保护，尽量远离致癌源。\n4、多饮水，勤排尿\n研究人员发现，与饮酒少的男性相比，每天饮用至少1.44升水（约6杯）的男性膀胱癌的发生率显着降低。平时应养成多饮水、多饮茶、勤排尿的习惯，可降低膀胱内尿液中致癌物的浓度，减少对膀胱黏膜造成的伤害。",
        "preventionCheckup": "膀胱癌的大小、数目、分期与分级与其进展密切相关，尤其是分期与分级，应早期检查，早诊断早治疗。\n1、血尿常规、血生化\n2、尿脱落细胞学、尿液肿瘤标记物检测\n3、腹部及盆腔B超/CT/MRI\n3、膀胱镜检查",
