        "symptom": "1、症状\n患者早期可有鼻塞、血涕、耳鸣耳聋、头痛、面部麻木和复视等症状。通过病人的视觉或触摸，鼻咽癌出现的血涕通常为涕中带血或回吸性血涕。\n2、体征\n主要有颈部肿块、鼻咽肿物、颅神经损害。颈部淋巴结肿大常是首发症状，淋巴结活检能有效确诊鼻咽癌。当癌症扩散后，还会引起骨疼痛或器官功能障碍。",
        "prevention": "早期发现、早期诊断、早治疗对于鼻咽癌来说最为重要，鼻咽癌以放射治疗为主，残余病灶可手术切除。",
        "preventionGeneral": "1、改善不良的生活方式\n戒烟戒酒，吸烟与多种癌症的发病相关，包括鼻咽癌，而且吸烟量越大、吸烟史越长，癌症的发病率就越高，戒烟是最重要的防癌措施。增加运动，增强免疫力，生活规律，减少感冒与病毒感染的机会，及早治疗病毒感染。\n2、调整饮食结构\n成人每天食盐量不应超过6克，限制腌制食物及调料盐的摄入，减少食物中盐腌制食物的比例，严禁食用亚硝胺类食物。减少脂肪和肉类摄入，选择植物脂肪，限制动物脂肪，肉类以鱼、家禽为主。多吃新鲜的水果、蔬菜和纤维素。\n3、环境因素\n避免接触污染较重的外界空气环境。",
        "preventionCheckup": "鼻咽癌的生存率与临床分期有明显关系，病期越早，疗效越好，因此，早期诊断非常重要。\n1、EB病毒检测\n2、鼻咽镜检查\n3、鼻炎病灶活检\n4、鼻咽和颈部CT、MRI检查",
        "geneticCorrelation": "鼻咽癌的发病与遗传因素有关，该病具有家族聚集现象，许多鼻咽癌患者有家族患癌病史，同时该病具有种族易感性，鼻咽癌主要见于黄种人，少见于白种人。",
