        "symptom": "1、早期表现\n黑色素瘤的早期征象包括：现有皮肤色素痣的形态或颜色改变、皮肤表面出现隆起物、色素痣瘙痒、局部出现破溃出血、指（趾）甲开裂等。早期皮肤黑色素瘤进一步发展可出现卫星灶、溃疡、反复不愈、区域淋巴结转移和移行转移。\n2、晚期表现\n晚期黑色素瘤根据不同的转移部位症状不一，容易转移的部位为肺、肝、骨、脑。眼和直肠来源的黑色素瘤容易发生肝转移。转移性黑色素瘤患者可能出现一系列非特异性症状，包括食欲减退、恶心、呕吐及乏力等。此外，黑色素瘤转移至机体各个不同部位可出现相应不同症状，例如骨转移可能出现骨痛、肺转移可能出现咳嗽、咯血等。",
        "prevention": "该肿瘤扩散迅速，可在诊断数月后死亡，所以要尽早发现、早期诊断、早期治疗。",
        "preventionGeneral": "1、避免紫外暴露\n做好皮肤防护，避免紫外暴露，可有效预防黑色素瘤的发生。\n2、关注黑痣变化\n黑色素瘤的预防要重点关注一些黑痣的变化，包括是否对称、边缘是否规则、颜色改变、直径大小、是否有隆起等，发生在易摩擦部位的色素痣应当更加引起重视。当发现有病似情况出现时，及时到医院检查是否为黑色素瘤。\n3、定期检查皮肤\n有黑色素瘤家族史，应从10岁开始定期检查皮肤。",
        "preventionCheckup": "对于存在高危因素的人群，预防性筛查及手术是必要的预防措施。\n1、实验室检查\n血常规、肝肾功能、LDH\n2、免疫组化、组织活检\n3、影像学检查\n电子皮镜检查、区域淋巴结超声、胸部X线或CT、腹盆部超声或CT",
        "geneticCorrelation": "遗传因素在黑色素瘤的发生、发展过程中起重要作用，有黑色素瘤病家族史(一个或一个以上的亲属曾患黑色素瘤)的人患病风险显著增加。",
