        "name": "甲状腺癌",
        "phenotypeTplId": 1,
        "introduction": "甲状腺属于内分泌器官，位于颈部甲状软骨下方，气管两旁，形似蝴蝶，犹如盾甲。甲状腺控制身体使用能量的速度、制造蛋白质、调节身体对其他荷尔蒙的敏感性。甲状腺癌是较常见的甲状腺恶性肿瘤，是来源于甲状腺上皮细胞的恶性肿瘤，约占人体全部恶性肿瘤的1－2%左右，女性明显多于男性，发病年龄一般为21－40岁，可见中青年是发病率较高的人群，近年来甲状腺癌在女性患病肿瘤中存在上升趋势。",
        "advise": "①　避免应用雌激素，因为雌激素对于甲状腺腺瘤的形成具有促进作用。。\n②　对于甲状腺增生性疾病以及良性肿瘤需要及时到正规医院做相关的治疗，避免因为这些不是很严重的疾病导致甲状腺腺瘤的发生。\n③　甲状腺腺瘤的发生与儿童时期接受x线照射头颈部以及胸部具有很大的关系，所以为了避免甲状腺腺瘤的发生，应该尽量避免在儿童时期接受x射线的照射。\n④　为了避免甲状腺腺瘤的发生，应该多吃一些富含营养物质的食物以及蔬菜水果等，不要吃肥腻辛辣之物。\n⑤　针对水土问题，需要注意饮食的调节与摄入，可以经常食用海带、海蛤、紫菜等海产品，同时多吃一些含碘的物质，比如加碘食盐等。",
        "cause": "1、癌基因及生长因子\n近代研究表明，许多人类肿瘤的发生与原癌基因序列的过度表达、突变或缺失有关。促甲状腺素（TSH）可促进甲状腺细胞的DNA合成，对甲状腺癌的发生有促进作用。\n2、电离辐射\n头颈部的外放射是甲状腺的重要致癌因素。放射线所诱发的甲状腺肿瘤往往是双侧的，一般潜伏期为10-15年。\n3、缺碘与高碘\n缺碘可导致甲状腺肿瘤，流行病学研究发现高碘饮食亦是甲状腺癌高发的诱因。我国东部沿海是高碘地区，亦是我国甲状腺乳头状癌高发地区。\n4、性别与女性激素\n甲状腺癌发病性别差异较大，女性明显高于男性。近年研究显示，雌激素可影响甲状腺生长，主要是促进TSH而作用于甲状腺。",
        "relatedGenes": "FOXE1基因位于人类第9号染色体长臂。此基因编码的蛋白是一种转录因子，在甲状腺形态发生中发挥作用，该基因突变被认为与甲状腺发育不良和功能减退有关，并可导致甲状腺非髓样癌风险增高。\nPTCSC3基因位于人类第14号染色体短臂。该基因是一种非编码RNA，能从基因组上转录而来但不翻译成蛋白质，在RNA水平直接行使其生物功能。该基因被证明能抑制癌细胞生长，阻滞细胞周期。\nVEGFA位于6号染色体上，是PDGF/VEGF生长因子家族的成员。该基因在许多已知肿瘤中被上调，其表达与肿瘤分期和进展相关。有研究显示VEGFA在甲状腺癌细胞中明显上调。",
