        "symptom": "1、甲状腺肿物\n肿物大小差异很大，少至几毫米，在B超或CT检查下发现，体检未发现明显肿物，大至20厘米以上，致患者颈部外观明显改变。\n2、甲状腺肿物产生的侵犯症状\n压迫气管，使气管移位，并有不同程度的呼吸困难的表现；侵犯气管患者会有咳嗽、咯血；肿瘤侵犯或压迫食管，会出现吞咽困难的表现；肿瘤侵犯喉返神经会出现声嘶。\n3、颈部淋巴结肿大\n甲状腺癌容易出现颈部淋巴结转移，约60％－80％患者有颈部转移，一部分患者首先是以颈部肿大淋巴结而就诊，后发现甲状腺肿物。淋巴结常转移到颈深上、中、下和颈前正中区。\n4、远处转移所致的症状\n转移到肺会有气促、咳血症状，转移到骨会出现疼痛、病理性骨折等。",
        "prevention": "甲状腺癌的病因并不是单一的，但对有危险因子的人群应引起重视，定期到专科医院检查，在非常早期发现恶变倾向，及早治疗。",
        "preventionGeneral": "1、避免应用雌激素\n雌激素对于甲状腺腺瘤的形成具有促进作用，在生活及疾病治疗中应避免使用雌激素相关的食物及药物。\n2、甲状腺增生性疾病以及良性肿瘤\n需要及时到正规医院做相关的治疗，避免因为这些不是很严重的疾病导致甲状腺腺瘤的发生。\n3、避免射线的照射\n甲状腺腺瘤的发生与儿童时期接受X线照射头颈部以及胸部有很大的关系，所以为了避免甲状腺腺瘤的发生，应该尽量避免在儿童时期接受X线的照射。\n4、饮食调整\n注意饮食的调节与摄入，常食海带、海蛤、紫菜等海产品，注意碘的摄入。多食一些富含营养物质的食物以及蔬菜水果等，不吃肥甘厚腻及辛辣刺激性食物。\n5、生活环境\n对于生活环境所处的缺碘及高碘的不同，应相应的调整碘的摄入，并定期进行检测。",
        "preventionCheckup": "甲状腺肿物已明显者，应尽早进行相关专科检查并得以确诊，尽早治疗。\n1、甲状腺免疫学、甲功五项检查\n2、碘131摄取率\n3、甲状腺B超、CT、MRI\n4、甲状腺放射性核素显像检查",
        "geneticCorrelation": "家族性甲状腺乳头状癌发生率在5%-10%，甲状腺髓样癌有家族遗传倾向。",
