        "symptom": "1、早期症状\n前列腺癌多数无明显临床症状，可表现为下尿路梗阻症状，如尿频、尿急、尿流缓慢、尿流中断、排尿不尽、甚至尿潴留或尿失禁。\n2、转移症状\n侵及膀胱、精囊、血管神经束时，可引起血尿、血精、阳痿。盆腔淋巴结转移可引起双下肢水肿。发生骨转移时可引起骨痛或病理性骨折、截瘫。侵及骨髓引起贫血或全血象减少。",
        "prevention": "目前根据调查研究，前列腺癌的患病率与年龄及种族、遗传有很大的关系，对于高危人群，应积极进行生活、饮食方式的转变，定期进行体检以尽早发现并早期治疗。",
        "preventionGeneral": "1、调整饮食和生活方式\n多食富含维生素的水果蔬菜及豆类产品，如番茄、大豆等食物。少食过量的饱和脂肪酸及红肉制品，平时要多饮水，多排尿。\n2、适当进行体育锻炼\n定期运动的男性可能具有稍低的患病风险。避免对前列腺进行压迫，不要长时间久坐不动，要适当休息并及时变换体位，避免前列腺的局部充血的现象。\n3、药物干预\n研究表明，正在服用5-α-还原酶抑制剂（非那雄胺和度他雄胺）定期筛查的患者中，诊断前列腺癌的总体风险减少，需在专科医生的指导下遵医嘱执行。",
        "preventionCheckup": "对于具有家族遗传史、且年龄大于65岁以上的男性应定期的进行体检，降低前列腺癌的患病率。\n1、直肠指检\n2、前列腺特异抗原\n3、经直肠前列腺超声\n4、前列腺癌核素检查(ECT)",
        "geneticCorrelation": "家族史是前列腺癌的高位因素，一级亲属患有前列腺癌的患病风险是普通人的2倍，并且当患病亲属个数增加或患病年龄降低时，患病风险也会明显增加。此外重要基因的多态性是导致前列腺癌的另一个原因。",
