        "symptom": "1、早期症状\n起病缓慢，多无自觉症状。早期症状可能有乏力疲倦，而后出现食欲减退、消瘦、发热、盗汗等症状。\n2、其他症状\n60-80%患者有淋巴结肿大，50-70%患者有轻至中度脾大、轻度肝大，可出现贫血、血小板减少和粒细胞减少。",
        "prevention": "对于高危人群，应定期的进行专科检查，早期确诊后及时制定治疗方案和治疗时间，以便取得更好的治疗效果。",
        "preventionGeneral": "1、增强自身免疫力\n可通过适当运动，特别是户外活动，以增强自身免疫能力，从而预防慢性淋巴细胞白血病的发生。\n2、避免接触有害的物理、化学物品\n避免接触过多的X射线及其他有害的放射线，减少与苯等有害化学物品的接触。\n3、注意饮食卫生\n含有化肥、农药的蔬菜水果等食物，经消化吸收进入血液，容易破坏骨髓的正常造血功能从而导致CLL。",
        "preventionCheckup": "对于高危患者，尤其是50岁以上人群，应定期检查，以期早发现、早诊断、早治疗。\n1、血象、血生化、凝血功能\n2、骨髓象\n3、细胞化学、免疫学检查\n4、染色体和基因检测",
