        "symptom": "1、颅内压增高\n由于颅内压增高，会引起头痛、呕吐、惊厥等症状，视神经胶质瘤会引发失明，脊髓胶质瘤会产生疼痛、无力、四肢麻木等症状。\n2、神经功能缺失\n脑组织受肿瘤的压迫、浸润、破坏所产生的局部症状，造成神经功能缺失。",
