        "introduction": "基底细胞癌又称基底细胞上皮瘤，肿瘤由增生的基底细胞组成，细胞小，细胞质少，边界不清，细胞核大，卵圆形，常见于面部和暴露的身体部位，发展缓慢边缘呈珍珠状色泽，好发于头面部尤以鼻眼睑及颊部最为常见，可以破坏局部皮肤组织，很少发生转移，主要为局部的慢性浸润性生长。本病以50-60岁多发，近年有年轻化趋势，男多于女，白种人多发，好发于头、面、颈及手背等处，尤其是面部较突出的部位。",
        "advise": "避免过度受到阳光照射，尤其是在上午10点到下午3点的时间段内，这段时间内的紫外线辐射最强。在户外时，最好穿长袖的衣服和长裤，戴上帽子，太阳眼镜，并使用防晒产品。无论是成人还是儿童，都应采取这些预防措施。",
        "cause": "1、紫外线照射\n本病发生可能和受长期日晒有关，那些长时间受到日光照射的人最有可能患皮肤癌。在白人中皮肤癌的发病率是黑人的10倍以上。\n2、化学致癌物质\n比如暴露在煤焦油、杂芬油、砷化合物、沥青以及辐射等环境中，也会使罹患皮肤癌的可能性增高。\n3、慢性致癌物质\n体表皮肤慢性炎症或刺激区域可发生皮肤癌，如性病肉芽肿、梅毒、麻风、SLE、慢性溃疡等。\n4、免疫抑制和免疫缺陷状态\n器官移植免疫抑制剂应用易患皮肤癌。",
