        "introduction": "睾丸癌是一种发生于男性生殖系统之一的癌症，发生于睾丸组织，病理来源复杂，临床上相对罕见。男人一生中得到睾丸癌的概率大约为0.4%，睾丸癌最常出现于15到34岁的男性身上，特别是约25岁的年纪。",
        "advise": "①　饮食方面\n以激素类种植、养殖食物为最危险。如烧烤、煎炒、炸、过于油腻等食物也是引起肿瘤的根源;一些采用农药、化肥种植的食物也是应该避免的。隔夜的饭菜不应该吃，含致癌的亚硝酸盐类。应多吃根茎类食物：比如地下长的红薯、芋头等，玉米、板栗等;肉类以白色肉为主，红色肉次之：如鱼肉为白、猪肉为红。\n②　作息要规律\n少接触污染空气的地方或工作。此外对于辐射的机器要适当远离：比如电脑、电磁炉、微波炉、手机要远离睡眠区;对于噪声大的地方，适当远离。\n③　心情要积极\n性格方面对睾丸影响很大。因为睾丸区属于内分泌系统，性格很容易对其产生影响。临床调查发现，大量的睾丸增生者或睾丸癌患者，具有负性性格、不开朗、长期抑郁或压抑等特点。应该注意在生活中合理发泄情绪、不压抑、善于积极思考问题。比如主动寻求问题的解决而不是等待问题的解决。",
