        "symptom": "1、早期症状\n早期症状轻微，易被忽略，常见症状为咽部不适、异物感。肿瘤增大或破溃感染后出现咽痛，进食时加重，也可因舌咽神经反射造成耳内痛。\n2、侵犯症状\n肿瘤如向咽侧侵犯，侵及翼内肌则引起张口困难。舌根部肿瘤向深部侵犯，侵及舌神经和舌下神经后出现半舌麻木，伸舌困难，言语时似口中含物。\n3、其他症状\n病人常有唾液带血、口臭、呼吸不畅等。肿瘤增大后会造成吞咽困难，呼吸道阻塞。软腭肿瘤绝大多数发生在口咽面，晚期才穿透至软腭背面。",
        "prevention": "由于口咽部解剖隐蔽，毗邻关系复杂，故远期疗效较差。局部详细检查口咽部，即可见肿瘤，活体组织检查是确诊的必要手段。",
        "preventionGeneral": "1、避免致癌因素\n主要在于避免各种致癌因素，如烟草、乙醇及不良生活习惯和方式，减少口腔癌风险性，这对口腔癌患者防止第二原发癌的发生也很重要。研究发现口腔癌质量后继续吸烟者，其第二原发癌的发生率高于戒烟者和不吸烟者。\n2、化学预防\n基于癌症的发生是多步骤和多灶性的，化学预防也被提出。维A酸是最有前途的一类化合物，越来越受到人们重视，研究表明，维A酸通过一系列复杂的机制能够逆转癌变过程。\n3、高危人群筛查\n对高危人群定期筛查是一个简单易行的方法，高危人群如大量吸食烟草制品、大量饮用乙醇、病毒感染、较少食用蔬菜水果、食用槟榔、年纪大于45岁男性等。",
