        "introduction": "钙元素是人体必需的常量元素，不仅参加骨骼和牙齿的形成，还参与机体的新陈代谢。儿童的体内钙质容易流失，也常常摄取不足。缺钙会引起软骨病、佝偻病、生发迟、出牙迟、站立迟、走路迟、说话迟、龋齿、厌食、消瘦、多汗、夜啼、好动症等，如果在儿童成长阶段缺乏钙元素，将大大影响其发育。青少年缺钙容易引起骨骼生长不良、发育迟缓、牙齿发育畸形、荨麻疹、近视眼等症状。",
        "advise": "中国营养学会提出的成年人钙适宜摄入量（AI）为800mg/日。膳食中不利于钙吸收的因素有，谷物中的植酸，某些蔬菜（如菠菜、苋菜、竹笋等）中的草酸，过多的膳食纤维，碱性磷酸盐，脂肪等。抗酸药、四环素、肝素也不利于钙的吸收。蛋白质摄入过高，增加肾小球滤过率，降低肾小管对钙的再吸收，使钙排出增加。钙的吸收与年龄有关，随年龄增长其吸收率下降。婴儿钙的吸收率超过50%，儿童约为40%，成年人只为20%左右。一般在40岁以后，钙吸收率逐渐下降。但在人体对钙的需要量大时，钙的吸收率增加，妊娠、哺乳和青春期，钙的需要量最大，因而钙的吸收率增高；需要量小时，吸收率降低。富含钙的食物有全脂奶粉（930mg/100g）、奶酪（796mg/100g）、芝麻酱（612mg/100g）、乳鸽（866mg/100g）、带鱼（431mg/100g）、草鱼（448mg/100g）、豆腐皮（239mg/100g）、辣椒（152mg/100g）、油菜（148mg/100g）、牛奶（101.2mg/100g）等。",
        "cause": "",
