        "phenotypeTplId": 4,
        "introduction": "高密度脂蛋白是血清的一种蛋白，简称为HDL，亦称为a1脂蛋白（“高密度脂蛋白”）。高密度脂蛋白富含磷脂质，在血清中的含量约为300mg/dl。由于可输出胆固醇促进胆固醇的代谢，所以现在作为动脉硬化预防因子而受到重视。高密度脂蛋白运载周围组织中的胆固醇，再转化为胆汁酸或直接通过胆汁从肠道排出，动脉造影证明高密度脂蛋白胆固醇含量与动脉管腔狭窄程度呈显著的负相关。所以高密度脂蛋白是一种抗动脉粥样硬化的血浆脂蛋白，是冠心病的保护因子。俗称“血管清道夫”。 rs2271293位于NUTF2基因上，rs2271293次等位基因为A可以增加高密度脂蛋白(HDL) 水平，同时降低低密度脂蛋白(LDL)和甘油三酯(TG)水平。研究表明，TBL2与细胞内胆固醇的调节相关。单核苷酸多态性位点 rs17145738 位于人类染色体 7q11.23 区域的TBL2 基因下游，目前已有很多报道表明 rs17145738多态性与高密度脂蛋白水平相关。",
