        "introduction": "低密度脂蛋白是一种运载胆固醇进入外周组织细胞的脂蛋白颗粒，可被氧化成氧化低密度脂蛋白，当氧化修饰的低密度脂蛋白过量时，它携带的胆固醇便积存在动脉壁上，久了容易引起动脉硬化。因此低密度脂蛋白被称为“坏的脂蛋白”。低密度脂蛋白偏高的危害有以下三个方面：\n1.形成动脉粥样硬化斑块，如果血液中LDL-C浓度升高，它将沉积于心脑等部位的血管动脉壁内，逐渐形成动脉粥样硬化斑块，阻塞相应的血管。 \n2.引发多种疾病，引起冠心病、脑卒中和外周动脉病等致死致残的严重性疾病。\n3.危及心脏，LDL-C水平如果超出正常范围时就会使心脏疾病的危险性增加。如果降低LDL-C水平，则预示着可以降低冠心病的危险。\nLDLR为跨膜蛋白，广泛分布于肝脏、动脉壁平滑肌、血管内皮细胞和白细胞，特异结合含载脂蛋白B和载脂蛋白E的脂蛋白进入细胞内进行代谢, 可清除血中2/3的LDL。",
