        "introduction": "人类C反应蛋白( CRP )是一种非特异性急性期反应蛋白，主要由肝脏合成。在生理条件下,CRP以1~10 mg/ d的速率在体内缓慢合成，并以较高的亲和力与内质网羧酸酯酶相结合。当全身或局部发生炎症反应时, CRP 基因表达迅速上调，同时空间构象及性状发生改变，从而使与内质网中的羧酸酯酶的亲和力下降，最终导致 CRP 从内质网中的释放速率显著加快，血浆中CRP 的浓度在炎症反应 6-8小时内急剧升高，并可升高到正常水平的 100~1000 倍。 CRP可以激活补体和加强吞噬细胞的吞噬而起到调理作用，从而清除入侵机体的病原微生物和损伤、坏死、凋亡的组织细胞，在机体的天然免疫过程中发挥重要的保护作用。",
