        "introduction": "耳垢，又称耵聍，是由外耳道耵聍腺分泌出的淡黄色粘稠液体遇空气干燥后形成的，有的在空气中干燥后呈薄片状；有的耵聍如黏稠的油脂，俗称“油耳”。耵聍具有保护外耳道皮肤和黏附外界异物的作用，平时借助咀嚼、张口等运动，耵聍多自行排出。若耵聍逐渐凝聚成团，阻塞于外耳道内，即称耵聍栓塞。若耵聍压迫外耳道后壁皮肤，可因刺激迷走神经耳支而引起反射性咳嗽；若遇水膨胀时可致听力骤降。研究发现ABCC11基因多态性位点 rs17822931决定耳垢的性状，并且有极强的人群差异性，干性耳垢多见于亚裔人群，而湿性耳垢在非洲及高加索人中多见。",
