        "introduction": "GRACILE综合征是一种严重的遗传性疾病，从出生前就开始发病。该病的临床特征包括：生长发育迟缓，氨基酸尿，胆汁淤积，铁离子过量，乳酸性酸中毒，早期死亡。该病患儿在出生前便开始缓慢发育（宫内发育迟缓)，由于无法按照预期的速度发育和生长，患病胎儿体重小于平均婴儿出生体重（胎儿发育衰竭)。GRACILE综合征患者体内有大量铁离子、乳酸和氨基酸积累，并具有乳酸酸中毒，肝硬化，肾脏缺陷等健康问题。",
