        "introduction": "遗传性果糖不耐受是由常染色体隐性遗传所致的遗传代谢病，是由于果糖代谢途径中，果糖二磷酸醛缩酶缺陷所致。发病与所用饮食中含蔗糖和果糖成份有关，若不及时终止这类食物则患儿迅速出现食欲不振、腹泻、体重不增、肝肿大、黄疸、浮肿和腹泻等症状，少数患儿可能因未及时诊断治疗而死于进行性肝功能衰竭。",
