        "introduction": "遗传性凝血因子XI（FXI）缺陷症为常染色体隐性遗传性疾病，曾被称为血友病C，患者出血症状轻重不定，FXI水平高低与出血程度并不成正比，很少有自发性出血。凝血因子XI（FXI）是由肝脏合成的，是一种血浆丝氨酸蛋白酶原之一，FXI在传统的凝血瀑布学说中是接触凝血系统( 即内源性凝血途径) 的成份之一，活化的 FXIa在Ca2+的存在下能活化FIX，从而促进凝血过程的发生，近来新的研究发现，FXI的主要作用是在血凝块形成后促进凝血酶的持续生成，而且还有间接抑制纤溶的作用，从而可以稳定已经形成的凝血块。",
