        "introduction": "在人体的肾上腺髓质、交感神经节等部位存在嗜铬细胞，具有分泌肾上腺素和去甲肾上腺素等儿茶酚胺类激素的功能。嗜铬细胞瘤即是起源于这些部位的内分泌疾病，这种瘤持续或间断地释放大量儿茶酚胺，引起持续性或阵发性高血压和多个器官功能及代谢紊乱。某些患者可因长期高血压致严重的心、脑、肾损害或因突发严重高血压而导致危象，危及生命。但如能及时、早期获得诊断和治疗，是一种可治愈的继发性高血压病。",
