        "symptom": "1、典型症状\n发病一般比较急骤，口渴、多饮、多尿、多食以及消瘦，体重急剧下降等症状十分明显，还伴有口干、乏力。有的患者首发即有酮症酸中毒，糖尿病酮症酸中毒的症状包括皮肤干燥、呼吸深快、嗜睡、腹痛、呕吐等。\n2、并发症\n1型糖尿病患者常伴发抑郁症及乳糜泻，此外血糖波动较大，最终所导致的后果是有时血糖水平过高（可能伴发糖尿病酮症酸中毒），有时则严重的过低。",
        "prevention": "1型糖尿病多为自身免疫缺陷疾病，一旦确诊，终身依赖胰岛素治疗。",
        "preventionGeneral": "1、加强糖尿病宣传教育\n普及糖尿病防治知识，认识到糖尿病是终身疾病，治疗需持之以恒。\n2、养成良好生活、饮食习惯\n生活规律，戒烟和烈性酒，讲究个人卫生，预防各种感染。限制摄入高能量食物及含糖饮料。\n3、控制体重\n肥胖者BMI控制在24或以下。\n4、适当运动\n有规律的合适运动，根据年龄、性别、体力、病情及有无并发症等不同条件，循序渐进，长期坚持。体育锻炼宜在餐后进行，运动量不宜过大，持续时间不宜过长。建议中等强度身体活动，每天30分钟，每周至少5天。",
        "preventionCheckup": "对有T1DM家族史者，建议定期做以下相关检查。\n1、尿糖测定、血糖测定、糖化血红蛋白\n2、葡萄糖耐量试验、胰岛β细胞功能检查\n3、抗体试验（胰岛素自身抗体、胰岛细胞抗体、谷氨酸脱羧酶抗体）",
