        "introduction": "维生素 B3（Vitamin B3，又叫烟酸）是人体必需的维生素之一，是一种水溶性维生素，烟酸在人体内转化为烟酰胺，是辅酶Ⅰ和辅酶Ⅱ的组成部分，参与体内的脂质代谢、组织呼吸的氧化过程和糖类的无氧分解过程。对于人体来说摄入适量的烟酸是必需的。烟酸的缺乏可引起一系列皮肤、消化系统和神经系统等疾病。烟酸是葡萄糖耐量因子的组成物，在人体中可以增强胰岛素的作用。因此，烟酸可以调节血糖水平。",
        "advise": "烟酸及烟酰胺广泛存在于食物中,植物性食物中存在的主要是烟酸,动物性食物中以烟酰胺为主。烟酸和烟酰胺在肝、肾、瘦畜肉、鱼以及坚果类中含量丰富,乳、蛋中的含量虽然不高,但色氨酸较多,可转化为烟酸。中国营养学会建议维生素B3的摄入量为：成年男性为14mgNE/天，成年女性为13mgNE/天。富含烟酸的食物有鸡腿菇（24.99mg/100g）、花生酱（22.75mg/100g）、金枪鱼（0.51mg/100g）、鸡胸脯肉（0.5mg/100g）、猪肝（10.11mg/100g）、猪肉（通脊）（9.67mg/100g）、牛肉（里脊肉）（6.24mg/100g）、花生（12.13mg/100g）、辣椒（9.53mg/100g）、荞麦面（3.47mg/100g）等。",
