        "introduction": "卡路里的摄入和健康有着密切的关系,过度摄入卡路里是导致肥胖以及相关的心血管疾病的主要原因。如果每日多摄入3500卡路里,机体就会储存约0.45公斤脂肪。一般来说, 成年人每天至少需要约1500千卡的能量来维持身体机能,我们的机体通过代谢作用“燃 烧”食物中的卡路里，每个人的基本代谢速率是由基因、身高、体重、年龄、性别等决定的, 所以在定制每日卡路里摄入计划时,这些因素都需要参考。根据目前的研究,基因在很大程度上影响能量代谢的各个过程,拥有不同突变基因的人对摄入过量的卡路里的反应也不同。ADIPOQ、FTO 和 MC4R基因上部分位点的突变使人们更加容易过量摄入卡路里，或者由高卡路里带来的肥胖等健康风险明显会增加，而在LPL和PPARG基因上的突变能够提高我们的能量代谢能力，这样，过量摄入卡路里导致的健康风险就比较低。",
