        "phenotypeTplId": 3,
        "introduction": "饱和脂肪酸是含饱和键的脂肪酸,膳食中饱和脂肪酸多存在于动物脂肪及乳脂中,这些食物也富含胆固醇,饱和脂肪酸摄入量过高是导致血胆固醇、三酰甘油、低密度脂蛋白胆固醇 (LDL-C)升高的主要原因,继发引起动脉管腔狭窄,形成动脉粥样硬化,增加患冠心病的 风险,故进食较多的饱和脂肪酸也必然进食较多的胆固醇。实验研究发现,进食大量饱和脂肪酸后胆固醇的合成也增加。植物中富含饱和脂肪酸的有椰子油、棉籽油和可可油。",
