        "introduction": "膳食纤维是一种多糖,它既不能被胃肠道消化吸收,也不能产生能量。因此,曾一度被认为 是一种“无营养物质”而长期得不到足够的重视。随着营养学和相关科学的深入发展,人们逐 渐发现了膳食纤维具有相当重要的生理作用。在生活水平日益提高的现代社会,食物精细化 程度越来越高,动物性食物所占比例大为增加,而膳食纤维的摄入量却明显降低,所谓“生 活越来越好,纤维越来越少”。由此导致一些所谓“现代文明病”,如肥胖症、糖尿病、高脂 血症等,以及一些与膳食纤维过少有关的疾病,如肠癌、便秘、肠道息肉等发病率日渐增高。 小麦、玉米、糙米、大豆、燕麦、荞麦、茭白、芹菜、苦瓜、水果等食物中含有丰富的膳食纤维。 ",
