        "phenotypeTplId": 3,
        "introduction": "维生素 A（vitaminA）又称视黄醇，是人类的必需营养素之一，是维持一切上皮组织健全所必须的物质。维生素A缺乏会引起生殖功能衰退、骨骼生长不良、生长发育受阻等。此外，维生素A缺乏还可能降低对弱光敏感度，严重者可产生夜盲症。因此维生素A缺乏，亦会引起造血功能抑制而导致贫血、免疫力降低等问题。植物来源的β-胡萝卜素及其他胡萝卜素可在人体内合成维生素A。",
        "advise": "中国营养学会推荐摄入量成年男性为800ugRE/天，成年女性为700ugRE/天。维生素A是一个具有脂环的不饱和一元醇，包括动物性食物来源的维生素A1、A2 两种，是一类具有视黄醇生物活性的物质。维生素A1多存于哺乳动物及咸水鱼的肝脏中，维生素A2常存于淡水鱼的肝脏中。由于维生素A2的活性比较低，所以通常所说的维生素A是指维生素A1。富含维生素A的食物有猪肝（6502ug/100g）、胡萝卜（4107ug/100g）、小红尖辣椒（3376ug/100g）、小白菜（1856ug/100g）、韭菜（1596ug/100g）、芒果（2080ug/100g）、南瓜（1518/100g）、红薯（750ug/100g）、番茄（375ug/100g）、豌豆苗（333ug/100g）等。",
