        "name": "肝癌",
        "phenotypeTplId": 1,
        "introduction": "肝癌是指发生于肝脏的恶性肿瘤，包括原发性肝癌和转移性肝癌两种，本章主要以原发性肝癌为主。原发性肝癌是指由肝细胞或肝内胆管上皮细胞发生的恶性肿瘤，是我国常见的恶性肿瘤之一，其死亡率在消化系统恶性肿瘤中居第三位，仅次于胃癌和食管癌。全世界每年新发肝癌患者约六十万，居恶性肿瘤的第五位，在我国发病率有上升趋势。本病多见于中年男性，男女之比是2-5：1。",
        "advise": "1、积极治疗和预防病毒性肝炎\n表面抗原阴性者，应接种乙肝疫苗。慢性乙型肝炎者应积极进行治疗。\n2、饮食注意\n注意食物清洁，不吃霉变的大米、玉米、花生等，少吃含有亚硝酸盐的食物如火腿肠等，不饮用污染水。\n3、调整生活方式\n戒烟限酒、喝酒易引起肝脏细胞受损，导致酒精性的肝硬化，一部分肝硬化会转变为肝癌。\n4、避免药物性肝损伤\n避免滥用可引起肝损伤的药物，如某些口服避孕药物、甲基睾丸脂酮、扑热息痛、红霉素、某些降脂药物，以及可能含有致肝损伤成分的保健品。",
        "cause": "1、慢性病毒性肝炎\n在我国，慢性病毒性肝炎是原发性肝癌诸多致病因素中最重要的病因。最常见的病毒性肝炎有甲型、乙型和丙型肝炎，但只有慢性反复发作的乙型和丙型肝炎有发展成肝癌和肝硬化的危险。\n2、肝硬化\n原发性肝癌合并肝硬化的发生率各地报告为50%-90%，在我国原发性肝癌主要在病毒性肝炎后肝硬化基础上发生。在欧美国家，肝癌常在酒精性肝硬化的基础上发生。\n3、黄曲霉毒素\n流行病学调查发现粮食受到黄曲霉毒素污染严重的地区，人群肝癌发病率高，而黄曲霉毒素的代谢产物黄曲霉毒素B1有强烈的致癌作用。\n4、其他因素\n一些化学物质如亚硝胺类、有机氯农药、偶氮芥类等均是可疑的致癌物质。饮酒或酗酒也能增加患肝癌的机率，大约15%的嗜酒者将发展成肝硬化，肝硬化患者患肝癌的风险颇高。此外饮用水污染也是诱发疾病的危险因素。",
