        "symptom": "1、肝区疼痛\n是肝癌最常见的症状，疼痛多呈持续性胀痛或钝痛，是因癌肿生长过快，肝包膜被牵拉所致。\n2、肝脏肿大\n肝脏呈进行性增大，质地坚硬，表面凹凸不平，常有大小不等的结节，边缘钝而不整齐，常有不同程度的压痛。\n3、黄疸\n一般出现在肝癌晚期，多为阻塞性黄疸，少数为肝细胞性黄疸。\n4、肝硬化征象\n在失代偿期肝硬化基础上发病者有基础病的临床表现，原有腹水者表现为腹水迅速增加且具难治性，腹水一般为漏出液。\n5、全身性表现\n有进行性消瘦、发热、食欲不振、乏力、营养不良和恶病质等。\n6、转移灶症状\n转移至肺、骨、脑、淋巴结、胸腔等处时可产生相应的症状，有患者因转移灶症状首次就诊。\n7、伴癌综合征\n表现为自发性低血糖症、红细胞增多症，罕见的有高钙血症、高脂血症等。",
        "prevention": "慢性病毒性肝炎、肝硬化等疾病都有癌变的可能，因此发现身体不适要及早治疗，做好癌变预防。",
        "preventionGeneral": "1、积极治疗和预防病毒性肝炎\n表面抗原阴性者，应接种乙肝疫苗。慢性乙型肝炎者应积极进行治疗。\n2、饮食\n注意食物清洁，不吃霉变的大米、玉米、花生等。少吃含有亚硝酸盐的食物如火腿肠等。不饮用污染水源。\n3、戒烟戒酒\n喝酒易引起肝脏细胞受损，导致酒精性的肝硬化，一部分肝硬化会转变为肝癌。\n4、避免药物性肝损伤\n避免滥用可引起肝损伤的药物，如某些口服避孕药物、甲基睾丸脂酮、扑热息痛、红霉素、某些降脂药物，以及可能含有致肝损伤成分的保健品。",
