        "introduction": "高密度人口的经济及社会活动必然会排放大量细颗粒物（PM 2.5），一旦排放超过大气循环能力和承载度，细颗粒物浓度将持续积聚，此时如果受静稳天气等影响，极易出现大范围的雾霾。多环芳烃（PAHs）是常见的大气污染物，它是煤、天然气和石油等化石燃料产生的。这些污染物通过各种途径进入人体。",
