        "phenotypeTplId": 4,
        "introduction": "在能量转换过程中，细胞产生的自由基通过连锁反应破坏周围的分子，引起皮肤老化和身体衰老。而人体有自己的抗氧化系统，它可以中和掉自由基。自由基的产生与中和之间的平衡被打破称为氧化应激。 体内有一些基因负责产生中和自由基的酶。如果这些基因发生突变，机体中和自由基的能力则会降低。如果您天生没有中和自由基的能力，那么您可以补充更多的抗氧化剂，增加您抗氧化应激的能力。辅酶Q10是一种强力的抗氧化剂，能够中和自由基，但它只有通过某种基因转化为活性形式泛醇后才能发挥作用。如果这个基因不起作用，辅酶Q10就不能转化为泛醇，无法中和自由基。",
        "advise": "很多情形和因素都会使自由基的产生增加，如情绪高度紧张、空气、水、食物的污染，吸烟、药物、紫外线照射和辐射等等。目前的进一步研究发现自由基的产生可以出现在细胞线粒体中的氧化磷酸化、免疫过程中的中性粒细胞的吞噬作用，及肝脏对水、食物、空气污染的解毒过程中，从分子水平到细胞水平都广泛存在，可以说无处不在无时不在。并且自由基是极其不稳定，这主要是由于它有未配对的电子，这些电子有高度的活性、相互影响的能力强，能对周边的环境产生重要的影响，所以必须尽快将它清除，否则就会产生氧化应激。健康的生活方式、压力的控制、保持情绪稳定对于维持氧化系统的平衡是非常重要的。",
